nclude additional pieces of information:\";'),('en','messages:apihelp-query+recentchanges-param-show','s:127:\"Show only items that meet these criteria. For example, to see only minor edits done by logged-in users, set $1show=minor|!anon.\";'),('en','messages:apihelp-query+recentchanges-param-start','s:40:\"The timestamp to start enumerating from.\";'),('en','messages:apihelp-query+recentchanges-param-tag','s:39:\"Only list changes tagged with this tag.\";'),('en','messages:apihelp-query+recentchanges-param-title','s:42:\"Filter entries to those related to a page.\";'),('en','messages:apihelp-query+recentchanges-param-token','s:81:\"Use <kbd>[[Special:ApiHelp/query+tokens|action=query&meta=tokens]]</kbd> instead.\";'),('en','messages:apihelp-query+recentchanges-param-toponly','s:48:\"Only list changes which are the latest revision.\";'),('en','messages:apihelp-query+recentchanges-param-type','s:31:\"Which types of changes to show.\";'),('en','messages:apihelp-query+recentchanges-param-user','s:31:\"Only list changes by this user.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-autopatrolled','s:53:\"Tags patrollable edits as being autopatrolled or not.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-comment','s:30:\"Adds the comment for the edit.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-flags','s:24:\"Adds flags for the edit.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-ids','s:68:\"Adds the page ID, recent changes ID and the new and old revision ID.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-loginfo','s:60:\"Adds log information (log ID, log type, etc) to log entries.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-parsedcomment','s:37:\"Adds the parsed comment for the edit.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-patrolled','s:57:\"Tags patrollable edits as being patrolled or unpatrolled.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-redirect','s:32:\"Tags edit if page is a redirect.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-sha1','s:65:\"Adds the content checksum for entries associated with a revision.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-sizes','s:42:\"Adds the new and old page length in bytes.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-tags','s:25:\"Lists tags for the entry.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-timestamp','s:27:\"Adds timestamp of the edit.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-title','s:32:\"Adds the page title of the edit.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-user','s:66:\"Adds the user responsible for the edit and tags if they are an IP.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-userid','s:42:\"Adds the user ID responsible for the edit.\";'),('en','messages:apihelp-query+recentchanges-summary','s:25:\"Enumerate recent changes.\";'),('en','messages:apihelp-query+redirects-example-generator','s:57:\"Get information about all redirects to the [[Main Page]].\";'),('en','messages:apihelp-query+redirects-example-simple','s:45:\"Get a list of redirects to the [[Main Page]].\";'),('en','messages:apihelp-query+redirects-param-limit','s:29:\"How many redirects to return.\";'),('en','messages:apihelp-query+redirects-param-namespace','s:39:\"Only include pages in these namespaces.\";'),('en','messages:apihelp-query+redirects-param-prop','s:24:\"Which properties to get:\";'),('en','messages:apihelp-query+redirects-param-show','s:139:\"Show only items that meet these criteria:\n;fragment:Only show redirects with a fragment.\n;!fragment:Only show redirects without a fragment.\";'),('en','messages:apihelp-query+redirects-paramvalue-prop-fragment','s:34:\"Fragment of each redirect, if any.\";'),('en','messages:apihelp-query+redirects-paramvalue-prop-pageid','s:25:\"Page ID of each redirect.\";'),('en','messages:apihelp-query+redirects-paramvalue-prop-title','s:23:\"Title of each redirect.\";'),('en','messages:apihelp-query+redirects-summary','s:41:\"Returns all redirects to the given pages.\";'),('en','messages:apihelp-query+revisions+base-param-contentformat','s:89:\"Serialization format used for <var>$1difftotext</var> and expected for output of content.\";'),('en','messages:apihelp-query+revisions+base-param-diffto','s:218:\"Use <kbd>[[Special:ApiHelp/compare|action=compare]]</kbd> instead. Revision ID to diff each revision to. Use <kbd>prev</kbd>, <kbd>next</kbd> and <kbd>cur</kbd> for the previous, next and current revision respectively.\";'),('en','messages:apihelp-query+revisions+base-param-difftotext','s:254:\"Use <kbd>[[Special:ApiHelp/compare|action=compare]]</kbd> instead. Text to diff each revision to. Only diffs a limited number of revisions. Overrides <var>$1diffto</var>. If <var>$1section</var> is set, only that section will be diffed against this text.\";'),('en','messages:apihelp-query+revisions+base-param-difftotextpst','s:177:\"Use <kbd>[[Special:ApiHelp/compare|action=compare]]</kbd> instead. Perform a pre-save transform on the text before diffing it. Only valid when used with <var>$1difftotext</var>.\";'),('en','messages:apihelp-query+revisions+base-param-expandtemplates','s:146:\"Use <kbd>[[Special:ApiHelp/expandtemplates|action=expandtemplates]]</kbd> instead. Expand templates in revision content (requires $1prop=content).\";'),('en','messages:apihelp-query+revisions+base-param-generatexml','s:207:\"Use <kbd>[[Special:ApiHelp/expandtemplates|action=expandtemplates]]</kbd> or <kbd>[[Special:ApiHelp/parse|action=parse]]</kbd> instead. Generate XML parse tree for revision content (requires $1prop=content).\";'),('en','messages:apihelp-query+revisions+base-param-limit','s:42:\"Limit how many revisions will be returned.\";'),('en','messages:apihelp-query+revisions+base-param-parse','s:187:\"Use <kbd>[[Special:ApiHelp/parse|action=parse]]</kbd> instead. Parse revision content (requires $1prop=content). For performance reasons, if this option is used, $1limit is enforced to 1.\";'),('en','messages:apihelp-query+revisions+base-param-prop','s:42:\"Which properties to get for each revision:\";'),('en','messages:apihelp-query+revisions+base-param-section','s:49:\"Only retrieve the content of this section number.\";'),('en','messages:apihelp-query+revisions+base-param-slots','s:203:\"Which revision slots to return data for, when slot-related properties are included in <var>$1props</var>. If omitted, data from the <kbd>main</kbd> slot will be returned in a backwards-compatible format.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-comment','s:37:\"Comment by the user for the revision.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-content','s:30:\"Content of each revision slot.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-contentmodel','s:39:\"Content model ID of each revision slot.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-flags','s:23:\"Revision flags (minor).\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-ids','s:23:\"The ID of the revision.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-parsedcomment','s:44:\"Parsed comment by the user for the revision.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-parsetree','s:216:\"Use <kbd>[[Special:ApiHelp/expandtemplates|action=expandtemplates]]</kbd> or <kbd>[[Special:ApiHelp/parse|action=parse]]</kbd> instead. The XML parse tree of revision content (requires content model <code>$1</code>).\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-roles','s:51:\"List content slot roles that exist in the revision.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-sha1','s:32:\"SHA-1 (base 16) of the revision.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-size','s:31:\"Length (bytes) of the revision.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-slotsha1','s:38:\"SHA-1 (base 16) of each revision slot.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-slotsize','s:37:\"Length (bytes) of each revision slot.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-tags','s:22:\"Tags for the revision.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-timestamp','s:30:\"The timestamp of the revision.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-user','s:28:\"User that made the revision.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-userid','s:32:\"User ID of the revision creator.\";'),('en','messages:apihelp-query+revisions-example-content','s:94:\"Get data with content for the last revision of titles <kbd>API</kbd> and <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-query+revisions-example-first5','s:50:\"Get first 5 revisions of the <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-query+revisions-example-first5-after','s:72:\"Get first 5 revisions of the <kbd>Main Page</kbd> made after 2006-05-01.\";'),('en','messages:apihelp-query+revisions-example-first5-not-localhost','s:108:\"Get first 5 revisions of the <kbd>Main Page</kbd> that were not made by anonymous user <kbd>127.0.0.1</kbd>.\";'),('en','messages:apihelp-query+revisions-example-first5-user','s:106:\"Get first 5 revisions of the <kbd>Main Page</kbd> that were made by the user <kbd>MediaWiki default</kbd>.\";'),('en','messages:apihelp-query+revisions-example-last5','s:49:\"Get last 5 revisions of the <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-query+revisions-extended-description','s:267:\"May be used in several ways:\n# Get data about a set of pages (last revision), by setting titles or pageids.\n# Get revisions for one given page, by using titles or pageids with start, end, or limit.\n# Get data about a set of revisions by setting their IDs with revids.\";'),('en',