itle of the matching section.\";'),('en','messages:apihelp-query+search-paramvalue-prop-size','s:35:\"Adds the size of the page in bytes.\";'),('en','messages:apihelp-query+search-paramvalue-prop-snippet','s:34:\"Adds a parsed snippet of the page.\";'),('en','messages:apihelp-query+search-paramvalue-prop-timestamp','s:52:\"Adds the timestamp of when the page was last edited.\";'),('en','messages:apihelp-query+search-paramvalue-prop-titlesnippet','s:40:\"Adds a parsed snippet of the page title.\";'),('en','messages:apihelp-query+search-paramvalue-prop-wordcount','s:32:\"Adds the word count of the page.\";'),('en','messages:apihelp-query+search-summary','s:27:\"Perform a full text search.\";'),('en','messages:apihelp-query+siteinfo-example-interwiki','s:41:\"Fetch a list of local interwiki prefixes.\";'),('en','messages:apihelp-query+siteinfo-example-replag','s:34:\"Check the current replication lag.\";'),('en','messages:apihelp-query+siteinfo-example-simple','s:23:\"Fetch site information.\";'),('en','messages:apihelp-query+siteinfo-param-filteriw','s:64:\"Return only local or only nonlocal entries of the interwiki map.\";'),('en','messages:apihelp-query+siteinfo-param-inlanguagecode','s:72:\"Language code for localised language names (best effort) and skin names.\";'),('en','messages:apihelp-query+siteinfo-param-numberingroup','s:41:\"Lists the number of users in user groups.\";'),('en','messages:apihelp-query+siteinfo-param-prop','s:25:\"Which information to get:\";'),('en','messages:apihelp-query+siteinfo-param-showalldb','s:61:\"List all database servers, not just the one lagging the most.\";'),('en','messages:apihelp-query+siteinfo-paramvalue-prop-dbrepllag','s:57:\"Returns database server with the highest replication lag.\";'),('en','messages:apihelp-query+siteinfo-paramvalue-prop-defaultoptions','s:48:\"Returns the default values for user preferences.\";'),('en','messages:apihelp-query+siteinfo-paramvalue-prop-extensions','s:41:\"Returns extensions installed on the wiki.\";'),('en','messages:apihelp-query+siteinfo-paramvalue-prop-extensiontags','s:40:\"Returns a list of parser extension tags.\";'),('en','messages:apihelp-query+siteinfo-paramvalue-prop-fileextensions','s:68:\"Returns list of file extensions (file types) allowed to be uploaded.\";'),('en','messages:apihelp-query+siteinfo-paramvalue-prop-functionhooks','s:40:\"Returns a list of parser function hooks.\";'),('en','messages:apihelp-query+siteinfo-paramvalue-prop-general','s:27:\"Overall system information.\";'),('en','messages:apihelp-query+siteinfo-paramvalue-prop-interwikimap','s:103:\"Returns interwiki map (optionally filtered, optionally localised by using <var>$1inlanguagecode</var>).\";'),('en','messages:apihelp-query+siteinfo-paramvalue-prop-languages','s:107:\"Returns a list of languages MediaWiki supports (optionally localised by using <var>$1inlanguagecode</var>).\";'),('en','messages:apihelp-query+siteinfo-paramvalue-prop-languagevariants','s:153:\"Returns a list of language codes for which [[mw:Special:MyLanguage/LanguageConverter|LanguageConverter]] is enabled, and the variants supported for each.\";'),('en','messages:apihelp-query+siteinfo-paramvalue-prop-libraries','s:40:\"Returns libraries installed on the wiki.\";'),('en','messages:apihelp-query+siteinfo-paramvalue-prop-magicwords','s:38:\"List of magic words and their aliases.\";'),('en','messages:apihelp-query+siteinfo-paramvalue-prop-namespacealiases','s:37:\"List of registered namespace aliases.\";'),('en','messages:apihelp-query+siteinfo-paramvalue-prop-namespaces','s:56:\"List of registered namespaces and their canonical names.\";'),('en','messages:apihelp-query+siteinfo-paramvalue-prop-protocols','s:63:\"Returns a list of protocols that are allowed in external links.\";'),('en','messages:apihelp-query+siteinfo-paramvalue-prop-restrictions','s:64:\"Returns information on available restriction (protection) types.\";'),('en','messages:apihelp-query+siteinfo-paramvalue-prop-rightsinfo','s:5