Afficher les utilisateurs appartenant aux groupes :\";'),('fr','messages:activeusers-intro','s:147:\"Ceci est une liste des utilisateurs qui ont exercé une quelconque activité au cours {{PLURAL:$1|de la dernière journée|des $1 derniers jours}}.\";'),('fr','messages:activeusers-noresult','s:26:\"Aucun utilisateur trouvé.\";'),('fr','messages:activeusers-submit','s:32:\"Afficher les utilisateurs actifs\";'),('fr','messages:activeusers-summary','s:0:\"\";'),('fr','messages:addedwatchtext','s:113:\"La page « [[:$1]] » et sa page de discussion ont été ajoutées à votre [[Special:Watchlist|liste de suivi]].\";'),('fr','messages:addedwatchtext-short','s:62:\"La page « $1 » a été ajoutée à votre liste de suivi.\";'),('fr','messages:addedwatchtext-talk','s:104:\"« [[:$1]] » et sa page associée ont été ajoutés à votre [[Special:Watchlist|liste de suivi]].\";'),('fr','messages:addsection','s:1:\"+\";'),('fr','messages:addsection-editintro','s:0:\"\";'),('fr','messages:addsection-preload','s:0:\"\";'),('fr','messages:addwatch','s:28:\"Ajouter à la liste de suivi\";'),('fr','messages:ago','s:9:\"Il y a $1\";'),('fr','messages:all-logs-page','s:25:\"Tous les journaux publics\";'),('fr','messages:allarticles','s:16:\"Toutes les pages\";'),('fr','messages:allinnamespace','s:43:\"Toutes les pages (dans l\'espace de noms $1)\";'),('fr','messages:alllogstext','s:238:\"Affichage combiné de tous les journaux disponibles sur {{SITENAME}}.\nVous pouvez personnaliser l\'affichage en sélectionnant le type de journal, le nom d\'utilisateur ou la page concernée (ces deux derniers étant sensibles à la casse).\";'),('fr','messages:allmessages','s:17:\"Messages système\";'),('fr','messages:allmessages-filter','s:35:\"Filtrer par état de modification :\";'),('fr','messages:allmessages-filter-all','s:4:\"Tous\";'),('fr','messages:allmessages-filter-legend','s:7:\"Filtrer\";'),('fr','messages:allmessages-filter-modified','s:8:\"Modifié\";'),('fr','messages:allmessages-filter-submit','s:9:\"Appliquer