2]] ([[User talk:$2|Discuter]]{{int:pipe-separator}}[[Special:Contributions/$2|{{int:contribslink}}]]) ;\nquelqu\'un d\'autre a déjà modifié ou révoqué la page.\n\nLa dernière modification de la page a été effectuée par [[User:$3|$3]] ([[User talk:$3|Discuter]]{{int:pipe-separator}}[[Special:Contributions/$3|{{int:contribslink}}]]).\";'),('fr','messages:ancientpages','s:38:\"Pages les plus anciennement modifiées\";'),('fr','messages:ancientpages-summary','s:0:\"\";'),('fr','messages:and','s:7:\"&#32;et\";'),('fr','messages:anoncontribs','s:13:\"Contributions\";'),('fr','messages:anoneditwarning','s:345:\"<strong>Attention :</strong> vous n’êtes pas connecté(e). Votre adresse IP sera visible de tout le monde si vous faites des modifications. Si vous <strong>[$1 vous connectez]</strong> ou <strong>[$2 créez un compte]</strong>, vos modifications seront attribuées à votre propre nom d’utilisateur(rice) et vous aurez d’autres avantages.\";'),('fr','messages:anonnotice','s:1:\"-\";'),('fr','messages:anononlyblock','s:38:\"utilisateur non enregistré uniquement\";'),('fr','messages:anonpreviewwarning','s:133:\"<em>Vous n’êtes pas connecté(e). Sauvegarder enregistrera votre adresse IP dans l’historique des modifications de la page.</em>\";'),('fr','messages:anontalk','s:10:\"Discussion\";'),('fr','messages:anontalkpagetext','s:625:\"----\n<em>Vous êtes sur la page de discussion d’un utilisateur anonyme qui n’a pas encore créé de compte ou qui n’en utilise pas</em>.\nPour cette raison, nous devons utiliser son adresse IP pour l’identifier.\nUne adresse IP peut être partagée par plusieurs utilisateurs.\nSi vous êtes un{{GENDER:||e|}} utilisat{{GENDER:|eur|rice|eur}} anonyme et si vous constatez que des commentaires qui ne vous concernent pas vous ont été adressés, vous pouvez [[Special:CreateAccount|créer un compte]] ou [[Special:UserLogin|vous connecter]] afin d’éviter toute confusion future avec d’autres contributeurs anonymes.\";'),('fr','messages:anonuser','s:40:\"l\'utilisateur anonyme $1 de {{SITENAME}}\";'),('fr','messages:anonusers','s:80:\"{{PLURAL:$2|l\'utilisateur anonyme|les utilisateurs anonymes}} $1 de {{SITENAME}}\";'),('fr','messages:anonymous','s:88:\"{{PLURAL:$1|Utilisateur non enregistré|Utilisateurs non enregistrés}} sur {{SITENAME}}\";'),('fr','messages:api-credits','s:422:\"Développeurs de l’API :\n* Roan Kattouw (développeur en chef Sept. 2007–2009)\n* Victor Vasiliev\n* Bryan Tong Minh\n* Sam Reed\n* Yuri Astrakhan (créateur, développeur en chef Sept. 2006–Sept. 2007)\n* Brad Jorsch (développeur en chef depuis 2013)\n\nVeuillez envoyer vos commentaires, suggestions et questions à mediawiki-api@lists.wikimedia.org\nou remplir un rapport de bogue sur https://phabricator.wikimedia.org/.\";'),('fr','messages:api-credits-header','s:13:\"Remerciements\";'),('fr','messages:api-error-badtoken','s:37:\"Erreur interne : mauvais « jeton ».\";'),('fr','messages:api-error-emptypage','s:45:\"Création de pages vide n\'est pas autorisée.\";'),('fr','messages:api-error-publishfailed','s:69:\"Erreur interne : Le serveur n\'a pas pu publier le fichier temporaire.\";'),('fr','messages:api-error-stashfailed','s:73:\"Erreur interne : le serveur n\'a pas pu enregistrer le fichier temporaire.\";'),('fr','messages:api-error-unknown-warning','s:37:\"Avertissement inconnu : « $1 ».\";'),('fr','messages:api-error-unknownerror','s:27:\"Erreur inconnue : « $1 ».\";'),('fr','messages:api-exception-trace','s:15:\"$1 à $2($3)\n$4\";'),('fr','messages:api-feed-error-title','s:11:\"Erreur ($1)\";'),('fr','messages:api-format-prettyprint-header','s:437:\"Voici la représentation HTML du format $1. HTML est utile pour le débogage, mais inapproprié pour être utilisé dans une application.\n\nSpécifiez le paramètre <var>format</var> pour modifier le format de sortie. Pour voir la représentation non HTML du format $1, mettez <kbd>format=$2</kbd>.\n\nVoyez la [[mw:Special:MyLanguage/API|documentation complète]], ou l’[[Special:ApiHelp/main|aide de l’API]] pour plus d’information.\";'),('fr','messages:api-format-prettyprint-header-hyperlinked','s:422:\"Voici la représentation HTML du format $1. HTML est bien pour le débogage, mais inapproprié pour être utilisé dans une application.\n\nSpécifiez le paramètre <var>format</var> pour modifier le format de sortie. Pour voir la représentation non HTML du format $1, mettez [$3 <kbd>format=$2</kbd>].\n\nVoir la [[mw:API|documentation complète]], ou l’ [[Special:ApiHelp/main|aide de l’API]] pour plus d’information.\";'),('fr','messages:api-format-prettyprint-header-only-html','s:258:\"Ceci est une représentation HTML à des fins de débogage, et n’est pas approprié pour une utilisation applicative.\n\nVoir la [[mw:Special:MyLanguage/API|documentation complète]], ou l’[[Special:ApiHelp/main|aide de l’API]] pour plus d’information.\";'),('fr','messages:api-format-prettyprint-status','s:57:\"Cette réponse serait retournée avec l\'état HTTP $1 $2.\";'),('fr','messages:api-format-title','s:33:\"Résultat de l’API de MediaWiki\";'),('fr','messages:api-help-authmanager-general-usage','s:1439:\"La procédure générale pour utiliser ce module est la suivante :\n# Récupérer les champs disponibles avec <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> avec <kbd>amirequestsfor=$4</kbd>, et un jeton <kbd>$5</kbd> avec <kbd>[[Special:ApiHelp/query+tokens|action=query&meta=tokens]]</kbd>.\n# Présenter les champs à l’utilisateur, et les lui faire soumettre.\n# Faire un envoi à ce module, en fournissant <var>$1returnurl</var> et les champs appropriés.\n# Vérifier le <samp>status</samp> dans la réponse.\n#* Si vous avez reçu <samp>PASS</samp> ou <samp>FAIL</samp>, c’est terminé. L’opération a soit réussi, soit échoué.\n#* Si vous avez reçu <samp>UI</samp>, affichez les nouveaux champs à l’utilisateur et faites-les-lui soumettre. Puis envoyez-les à ce module avec <var>$1continue</var> et l’ensemble des champs appropriés, et recommencez l’étape 4.\n#* Si vous avez reçu <samp>REDIRECT</samp>, envoyez l’utilisateur vers la cible <samp>redirecttarget</samp> et attendez le retour vers <var>$1returnurl</var>. Puis envoyez à ce module avec <var>$1continue</var> et tous les champs passés à l’URL de retour, puis répétez l’étape 4.\n#* Si vous avez reçu <samp>RESTART</samp>, cela veut dire que l’authentification a fonctionné, mais nous n’avons pas de compte utilisateur lié. Vous pouvez traiter cela comme un <samp>UI</samp> ou un <samp>FAIL</samp>.\";'),('fr','messages:api-help-authmanagerhelper-additional-params','s:375:\"Ce module accepte des paramètres supplémentaires selon les requêtes d’authentification disponibles. Utiliser <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> avec <kbd>amirequestsfor=$1</kbd> (ou une réponse précédente de ce module, le cas échéant) pour déterminer les requêtes disponibles et les champs qu’elles utilisent.\";'),('fr','messages:api-help-authmanagerhelper-continue','s:158:\"Cette requête est une continuation après une précédente réponse <samp>UI</samp> ou <samp>REDIRECT</samp>. Cela ou <var>$1returnurl</var> est obligatoire.\";'),('fr','messages:api-help-authmanagerhelper-mergerequestfields','s:89:\"Fusionner dans un tableau le champ information de toutes les demandes d\'authentification.\";'),('fr','messages:api-help-authmanagerhelper-messageformat','s:47:\"Format à utiliser pour retourner les messages.\";'),('fr','messages:api-help-authmanagerhelper-preservestate','s:88:\"Conserver l\'état d\'une précédente tentative de connexion qui a échoué, si possible.\";'),('fr','messages:api-help-authmanagerhelper-request','s:205:\"Utiliser cette requête d’authentification, avec l’<samp>id</samp> renvoyé par <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> avec <kbd>amirequestsfor=$1</kbd>.\";'),('fr','messages:api-help-authmanagerhelper-requests','s:264:\"Utiliser uniquement ces requêtes d’authentification, avec l’<samp>id</samp> renvoyé par <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> avec <kbd>amirequestsfor=$1</kbd> ou depuis une réponse précédente de ce module.\";'),('fr','messages:api-help-authmanagerhelper-returnurl','s:578:\"Renvoyer l’URL pour les flux d’authentification tiers, qui doit être absolue. Cela ou <var>$1continue</var> est obligatoire.\n\nDès réception d’une réponse <samp>REDIRECT</samp>, vous ouvrirez typiquement un navigateur ou un affichage web vers l’URL <samp>redirecttarget</samp> spécifiée pour un flux d’authentification tiers. Une fois ceci terminé, le tiers renverra le navigateur ou l’affichage web vers cette URL. Vous devez extraire toute requête ou paramètre POST de l’URL et les passer comme une requête <var>$1continue</var> à ce module de l’API.\";'),('fr','messages:api-help-datatypes','s:2274:\"Les entrées dans MédiaWiki doivent être en UTF-8 à la norme NFC. MédiaWiki peut tenter de convertir d’autres types d’entrée, mais cela peut faire échouer certaines opérations (comme les [[Special:ApiHelp/edit|modifications]] avec contrôles MD5) to fail.\n\nCertains types de paramètre dans les requêtes de l’API nécessitent plus d’explication :\n;boolean\n:Les paramètres booléens fonctionnent comme des cases à cocher HTML : si le paramètre est spécifié, quelle que soit sa valeur, il est considéré comme vrai. Pour une valeur fausse, enlever complètement le paramètre.\n;timestamp\n:Les horodatages peuvent être spécifiés sous différentes formes. Date et heure ISO 8601 est recommandé. Toutes les heures sont en UTC, tout fuseau horaire inclus est ignoré.\n:* Date et heure ISO 8601, <kbd><var>2001</var>-<var>01</var>-<var>15</var>T<var>14</var>:<var>56</var>:<var>00</var>Z</kbd> (la ponctuation et <kbd>Z</kbd> sont facultatifs)\n:* Date et heure ISO 8601 avec fractions de seconde (ignorées), <kbd><var>2001</var>-<var>01</var>-<var>15</var>T<var>14</var>:<var>56</var>:<var>00</var>.<var>00001</var>Z</kbd> (tirets, deux-points et <kbd>Z</kbd> sont facultatifs)\n:* Format MédiaWiki, <kbd><var>2001</var><var>01</var><var>15</var><var>14</var><var>56</var><var>00</var></kbd>\n:* Format numérique générique, <kbd><var>2001</var>-<var>01</var>-<var>15</var> <var>14</var>:<var>56</var>:<var>00</var></kbd> (fuseau horaire facultatif en <kbd>GMT</kbd>, <kbd>+<var>##</var></kbd>, ou <kbd>-<var>##</var></kbd> sont ignorés)\n:* Format EXIF, <kbd><var>2001</var>:<var>01</var>:<var>15</var> <var>14</var>:<var>56</var>:<var>00</var></kbd>\n:*Format RFC 2822 (le fuseau horaire est facultatif), <kbd><var>Mon</var>, <var>15</var> <var>Jan</var> <var>2001</var> <var>14</var>:<var>56</var>:<var>00</var></kbd>\n:* Format RFC 850 (le fuseau horaire est facultatif), <kbd><var>Monday</var>, <var>15</var>-<var>Jan</var>-<var>2001</var> <var>14</var>:<var>56</var>:<var>00</var></kbd>\n:* Format ctime C, <kbd><var>Mon</var> <var>Jan</var> <var>15</var> <var>14</var>:<var>56</var>:<var>00</var> <var>2001</var></kbd>\n:* Secondes depuis 1970-01-01T00:00:00Z sous forme d’entier de 1 à 13 chiffres (sans <kbd>0</kbd>)\n:* La chaîne <kbd>now</kbd>\";'),('fr','messages:api-help-datatypes-header','s:16:\"Type de données\";'),('fr','messages:api-help-examples','s:32:\"{{PLURAL:$1|Exemple|Exemples}} :\";'),('fr','messages:api-help-fallback-description','s:2:\"$1\";'),('fr','messages:api-help-fallback-example','s:2:\"$1\";'),('fr','messages:api-help-fallback-parameter','s:2:\"$1\";'),('fr','messages:api-help-flag-deprecated','s:22:\"Ce module est désuet.\";'),('fr','messages:api-help-flag-generator','s:49:\"Ce module peut être utilisé comme générateur.\";'),('fr','messages:api-help-flag-internal','s:105:\"<strong>Ce module est interne ou instable.</strong> Son fonctionnement peut être modifié sans préavis.\";'),('fr','messages:api-help-flag-mustbeposted','s:45:\"Ce module n’accepte que les requêtes POST.\";'),('fr','messages:api-help-flag-readrights','s:43:\"Ce module nécessite des droits de lecture.\";'),('fr','messages:api-help-flag-writeri