n>\";'),('fr','messages:api-help-templatedparams','s:640:\"Les paramètres de modèle supportent les cas où un module d’API a besoin d’une valeur pour chaque valeur d’un autre paramètre quelconque. Par exemple, s’il y avait un module d’API pour demander un fruit, il pourrait avoir un paramètre <var>fruits</var> pour spécifier quels fruits sont demandés et un paramètre de modèle <var>{fruit}-quantité</var> pour spécifier la quantité demandée de chaque fruit. Un client de l’API qui voudrait une pomme, cinq bananes et vingt fraises pourrait alors faire une requête comme <kbd>fruits=pommes|bananes|fraises&pommes-quantité=1&bananes-quantité=5&fraises-quantité=20</kbd>.\";'),('fr','messages:api-help-templatedparams-header','s:22:\"Paramètres de modèle\";'),('fr','messages:api-help-title','s:28:\"Aide de l’API de MediaWiki\";'),('fr','messages:api-help-undocumented-module','s:39:\"Aucune documentation pour le module $1.\";'),('fr','messages:api-login-fail-aborted','s:348:\"L’authentification nécessite une interaction avec l’utilisateur, qui n’est pas prise en charge par <kbd>action=login</kbd>. Pour pouvoir se connecter avec <kbd>action=login</kbd>, voyez [[Special:BotPasswords]]. Pour continuer à utiliser la connexion du compte principal, voyez <kbd>[[Special:ApiHelp/clientlogin|action=clientlogin]]</kbd>.\";'),('fr','messages:api-login-fail-aborted-nobotpw','s:218:\"L’authentification nécessite une interaction avec l’utilisateur, qui n’est pas prise en charge par <kbd>action=login</kbd>. Pour se connecter, voyez <kbd>[[Special:ApiHelp/clientlogin|action=clientlogin]]</kbd>.\";'),('fr','messages:api-login-fail-badsessionprovider','s:43:\"Impossible de se connecter en utilisant $1.\";'),('fr','messages:api-login-fail-sameorigin','s:86:\"Impossible de se connecter quand la politique de même origine n’est pas appliquée.\";'),('fr','messages:api-pageset-param-converttitles','s:234:\"Convertir les titres dans d’autres variantes si nécessaire. Fonctionne uniquement si la langue de contenu du wiki prend en charge la conversion en variantes. Les langues qui prennent en charge la conversion en variante incluent $1.\";'),('fr','messages:api-pageset-param-generator','s:229:\"Obtenir la liste des pages sur lesquelles travailler en exécutant le module de recherche spécifié.\n\n<strong>NOTE :<strong> les noms de paramètre du générateur doivent être préfixés avec un « g », voir les exemples.\";'),('fr','messages:api-pageset-param-pageids','s:52:\"Une liste des IDs de page sur lesquelles travailler.\";'),('fr','messages:api-pageset-param-redirects-generator','s:170:\"Résoudre automatiquement les redirections dans <var>$1titles</var>, <var>$1pageids</var> et <var>$1revids</var>, et dans les pages renvoyées par <var>$1generator</var>.\";'),('fr','messages:api-pageset-param-redirects-nogenerator','s:113:\"Résoudre automatiquement les redirections dans <var>$1titles</var>, <var>$1pageids</var> et <var>$1revids</var>.\";'),('fr','messages:api-pageset-param-revids','s:57:\"Une liste des IDs de révision sur lesquelles travailler.\";'),('fr','messages:api-pageset-param-titles','s:45:\"Une liste des titres sur lesquels travailler.\";'),('fr','messages:api-usage-docref','s:42:\"Voir $1 concernant l\'utilisation de l\'API.\";'),('fr','messages:api-usage-mailinglist-ref','s:223:\"S’abonner à la liste de diffusion mediawiki-api-announce sur &lt;https://lists.wikimedia.org/mailman/listinfo/mediawiki-api-announce&gt; pour les signalisations d’obsolescence de l’API ou de modifications en rupture.\";'),('fr','messages:apierror-allimages-redirect','s:139:\"Utiliser <kbd>gaifilterredir=nonredirects</kbd> au lieu de <var>redirects</var> quand <kbd>allimages</kbd> est utilisé comme générateur.\";'),('fr','messages:apierror-allpages-generator-redirects','s:141:\"Utiliser <kbd>gapfilterredir=nonredirects</kbd> au lieu de <var>redirects</var> quand <kbd>allpages</kbd> est utilisé comme un générateur.\";'),('fr','messages:apierror-appendnotsupported','s:68:\"Impossible d’ajo