y&prop=imageinfo&iiprop=archivename]].\";'),('fr','messages:apihelp-delete-param-pageid','s:88:\"ID de la page que vous voulez supprimer. Impossible à utiliser avec <var>$1title</var>.\";'),('fr','messages:apihelp-delete-param-reason','s:87:\"Motif de suppression. Si non défini, un motif généré automatiquement sera utilisé.\";'),('fr','messages:apihelp-delete-param-tags','s:82:\"Modifier les balises à appliquer à l’entrée dans le journal des suppressions.\";'),('fr','messages:apihelp-delete-param-title','s:92:\"Titre de la page que vous voulez supprimer. Impossible à utiliser avec <var>$1pageid</var>.\";'),('fr','messages:apihelp-delete-param-unwatch','s:63:\"Supprimer la page de la liste de suivi de l\'utilisateur actuel.\";'),('fr','messages:apihelp-delete-param-watch','s:63:\"Ajouter la page à la liste de suivi de l’utilisateur actuel.\";'),('fr','messages:apihelp-delete-param-watchlist','s:147:\"Ajouter ou supprimer sans distinction la page de la liste de suivi de l\'utilisateur actuel, utiliser les préférences ou ne rien changer au suivi.\";'),('fr','messages:apihelp-delete-summary','s:19:\"Supprimer une page.\";'),('fr','messages:apihelp-disabled-summary','s:30:\"Ce module a été désactivé.\";'),('fr','messages:apihelp-edit-example-edit','s:17:\"Modifier une page\";'),('fr','messages:apihelp-edit-example-prepend','s:52:\"Préfixer une page par <kbd>_&#95;NOTOC_&#95;</kbd>.\";'),('fr','messages:apihelp-edit-example-undo','s:64:\"Annuler les révisions 13579 à 13585 avec résumé automatique.\";'),('fr','messages:apihelp-edit-param-appendtext','s:140:\"Ajouter ce texte à la fin de la page. Écrase $1text.\n\nUtiliser $1section=new pour ajouter une nouvelle section, plutôt que ce paramètre.\";'),('fr','messages:apihelp-edit-param-basetimestamp','s:193:\"Horodatage de la révision de base, utilisé pour détecter les conflits de modification. Peut être obtenu via [[Special:ApiHelp/query+revisions|action=query&prop=revisions&rvprop=timestamp]].\";'),('fr','messages:apihelp-edit-param-bot','s:57:\"Marquer cette modification comme effectuée par un robot.\";'),('fr','messages:apihelp-edit-param-contentformat','s:71:\"Format de sérialisation du contenu utilisé pour le texte d’entrée.\";'),('fr','messages:apihelp-edit-param-contentmodel','s:38:\"Modèle de contenu du nouveau contenu.\";'),('fr','messages:apihelp-edit-param-createonly','s:46:\"Ne pas modifier la page si elle existe déjà.\";'),('fr','messages:apihelp-edit-param-md5','s:182:\"Le hachage MD5 du paramètre $1text, ou les paramètres $1prependtext et $1appendtext concaténés. Si défini, la modification ne sera pas effectuée sauf si le hachage est correct.\";'),('fr','messages:apihelp-edit-param-minor','s:21:\"Modification mineure.\";'),('fr','messages:apihelp-edit-param-nocreate','s:43:\"Lever une erreur si la page n’existe pas.\";'),('fr','messages:apihelp-edit-param-notminor','s:25:\"Modification non mineure.\";'),('fr','messages:apihelp-edit-param-pageid','s:87:\"ID de la page que vous voulez modifier. Impossible à utiliser avec <var>$1title</var>.\";'),('fr','messages:apihelp-edit-param-prependtext','s:54:\"Ajouter ce texte au début de la page. Écrase $1text.\";'),('fr','messages:apihelp-edit-param-recreate','s:82:\"Ignorer toutes les erreurs concernant la page \nqui a été supprimée entre-temps.\";'),('fr','messages:apihelp-edit-param-redirect','s:43:\"Résoudre automatiquement les redirections.\";'),('fr','messages:apihelp-edit-param-section','s:100:\"Numéro de section. <kbd>0</kbd> pour la section de tête, <kbd>new</kbd> pour une nouvelle section.\";'),('fr','messages:apihelp-edit-param-sectiontitle','s:35:\"Le titre pour une nouvelle section.\";'),('fr','messages:apihelp-edit-param-starttimestamp','s:323:\"L\'horodatage, lorsque le processus d\'édition est démarré, est utilisé pour détecter les conflits de modification. Une valeur appropriée peut être obtenue en utilisant <var>[[Special:ApiHelp/main|curtimestamp]]</var> lors du démarrage du processus d\'édition (par ex. en chargeant le contenu de la page à modifier).\";'),('fr','messages:apihelp-edit-param-summary','s:114:\"Modifier le résumé. Également le titre de la section quand $1section=new et $1sectiontitle n’est pas défini.\";'),('fr','messages:apihelp-edit-param-tags','s:48:\"Modifier les balises à appliquer à la version.\";'),('fr','messages:apihelp-edit-param-text','s:19:\"Contenu de la page.\";'),('fr','messages:apihelp-edit-param-title','s:95:\"Titre de la page que vous voulez modifier. Impossible de l’utiliser avec <var>$1pageid</var>.\";'),('fr','messages:apihelp-edit-param-token','s:109:\"Le jeton doit toujours être envoyé en tant que dernier paramètre, ou au moins après le paramètre $1text.\";'),('fr','messages:apihelp-edit-param-undo','s:71:\"Annuler cette révision. Écrase $1text, $1prependtext et $1appendtext.\";'),('fr','messages:apihelp-edit-param-undoafter','s:114:\"Annuler toutes les révisions depuis $1undo jusqu’à celle-ci. Si non défini, annuler uniquement une révision.\";'),('fr','messages:apihelp-edit-param-unwatch','s:63:\"Supprimer la page de la liste de suivi de l\'utilisateur actuel.\";'),('fr','messages:apihelp-edit-param-watch','s:61:\"Ajouter la page à la liste de suivi de l\'utilisateur actuel.\";'),('fr','messages:apihelp-edit-param-watchlist','s:123:\"Ajouter ou supprimer sans condition la page de votre liste de suivi, utiliser les préférences ou ne pas changer le suivi.\";'),('fr','messages:apihelp-edit-summary','s:29:\"Créer et modifier les pages.\";'),('fr','messages:apihelp-emailuser-example-email','s:93:\"Envoyer un courriel à l’utilisateur <kbd>WikiSysop</kbd> avec le texte <kbd>Content</kbd>.\";'),('fr','messages:apihelp-emailuser-param-ccme','s:37:\"M’envoyer une copie de ce courriel.\";'),('fr','messages:apihelp-emailuser-param-subject','s:17:\"Entête du sujet.\";'),('fr','messages:apihelp-emailuser-param-target','s:39:\"Utilisateur à qui envoyer le courriel.\";'),('fr','messages:apihelp-emailuser-param-text','s:18:\"Corps du courriel.\";'),('fr','messages:apihelp-emailuser-summary','s:38:\"Envoyer un courriel à un utilisateur.\";'),('fr','messages:apihelp-expandtemplates-example-simple','s:72:\"Développe le wikitexte <kbd><nowiki>{{Project:Sandbox}}</nowiki></kbd>.\";'),('fr','messages:apihelp-expandtemplates-param-generatexml','s:69:\"Générer l’arbre d’analyse XML (remplacé par $1prop=parsetree).\";'),('fr','messages:apihelp-expandtemplates-param-includecomments','s:57:\"S’il faut inclure les commentaires HTML dans la sortie.\";'),('fr','messages:apihelp-expandtemplates-param-prop','s:167:\"Quelles informations récupérer.\n\nNoter que si aucune valeur n’est sélectionnée, le résultat contiendra le wikitexte, mais la sortie sera dans un format désuet.\";'),('fr','messages:apihelp-expandtemplates-param-revid','s:95:\"ID de révision, pour <code><nowiki>{{REVISIONID}}</nowiki></code> et les variables semblables.\";'),('fr','messages:apihelp-expandtemplates-param-text','s:23:\"Wikitexte à convertir.\";'),('fr','messages:apihelp-expandtemplates-param-title','s:17:\"Titre de la page.\";'),('fr','messages:apihelp-expandtemplates-paramvalue-prop-categories','s:110:\"Toutes les catégories présentes dans l’entrée qui ne sont pas représentées dans la sortie du wikitexte.\";'),('fr','messages:apihelp-expandtemplates-paramvalue-prop-encodedjsconfigvars','s:105:\"Donne les variables de configuration JavaScript spécifiques à la page sous la forme d\'une chaîne JSON.\";'),('fr','messages:apihelp-expandtemplates-paramvalue-prop-jsconfigvars','s:72:\"Donne les variables de configuration JavaScript spécifiques à la page.\";'),('fr','messages:apihelp-expandtemplates-paramvalue-prop-modules','s:210:\"Tous les modules ResourceLoader que les fonctions d’analyse ont demandé d’ajouter à la sortie. Soit <kbd>jsconfigvars</kbd> soit <kbd>encodedjsconfigvars</kbd> doit être demandé avec <kbd>modules</kbd>.\";'),('fr','messages:apihelp-expandtemplates-paramvalue-prop-parsetree','s:41:\"L’arbre d’analyse XML de l’entrée.\";'),('fr','