er les contributions.\";'),('fr','messages:apihelp-feedcontributions-param-year','s:30:\"De l’année (et antérieur).\";'),('fr','messages:apihelp-feedcontributions-summary','s:52:\"Renvoie le fil des contributions d’un utilisateur.\";'),('fr','messages:apihelp-feedrecentchanges-example-30days','s:49:\"Afficher les modifications récentes sur 30 jours\";'),('fr','messages:apihelp-feedrecentchanges-example-simple','s:36:\"Afficher les modifications récentes\";'),('fr','messages:apihelp-feedrecentchanges-param-associated','s:62:\"Inclure l’espace de noms associé (discussion ou principal).\";'),('fr','messages:apihelp-feedrecentchanges-param-days','s:36:\"Jours auxquels limiter le résultat.\";'),('fr','messages:apihelp-feedrecentchanges-param-feedformat','s:18:\"Le format du flux.\";'),('fr','messages:apihelp-feedrecentchanges-param-from','s:39:\"Afficher les modifications depuis lors.\";'),('fr','messages:apihelp-feedrecentchanges-param-hideanons','s:63:\"Masquer les modifications faites par les utilisateurs anonymes.\";'),('fr','messages:apihelp-feedrecentchanges-param-hidebots','s:48:\"Masquer les modifications faites par des robots.\";'),('fr','messages:apihelp-feedrecentchanges-param-hidecategorization','s:56:\"Masquer les changements de la catégorie d\'appartenance.\";'),('fr','messages:apihelp-feedrecentchanges-param-hideliu','s:67:\"Masquer les modifications faites par les utilisateurs enregistrés.\";'),('fr','messages:apihelp-feedrecentchanges-param-hideminor','s:35:\"Masquer les modifications mineures.\";'),('fr','messages:apihelp-feedrecentchanges-param-hidemyself','s:58:\"Masquer les modifications faites par l\'utilisateur actuel.\";'),('fr','messages:apihelp-feedrecentchanges-param-hidepatrolled','s:39:\"Masquer les modifications contrôlées.\";'),('fr','messages:apihelp-feedrecentchanges-param-invert','s:50:\"Tous les espaces de noms sauf celui sélectionné.\";'),('fr','messages:apihelp-feedrecentchanges-param-limit','s:41:\"Nombre maximal de résultats à renvoyer.\";'),('fr','messages:apihelp-feedrecentchanges-param-namespace','s:45:\"Espace de noms auquel limiter les résultats.\";'),('fr','messages:apihelp-feedrecentchanges-param-showlinkedto','s:84:\"Afficher les modifications plutôt sur les pages liées vers la page sélectionnée.\";'),('fr','messages:apihelp-feedrecentchanges-param-tagfilter','s:19:\"Filtrer par balise.\";'),('fr','messages:apihelp-feedrecentchanges-param-target','s:77:\"Afficher uniquement les modifications sur les pages liées depuis cette page.\";'),('fr','messages:apihelp-feedrecentchanges-summary','s:42:\"Renvoie un fil de modifications récentes.\";'),('fr','messages:apihelp-feedwatchlist-example-all6hrs','s:84:\"Afficher toutes les modifications sur les pages suivies dans les dernières 6 heures\";'),('fr','messages:apihelp-feedwatchlist-example-default','s:37:\"Afficher le flux de la liste de suivi\";'),('fr','messages:apihelp-feedwatchlist-param-feedformat','s:18:\"Le format du flux.\";'),('fr','messages:apihelp-feedwatchlist-param-hours','s:75:\"Lister les pages modifiées lors de ce nombre d’heures depuis maintenant.\";'),('fr','messages:apihelp-feedwatchlist-param-linktosections','s:57:\"Lier directement vers les sections modifées si possible.\";'),('fr','messages:apihelp-feedwatchlist-summary','s:34:\"Renvoie un flux de liste de suivi.\";'),('fr','messages:apihelp-filerevert-example-revert','s:81:\"Rétablir <kbd>Wiki.png</kbd> dans la version du <kbd>2011-03-05T15:27:40Z</kbd>.\";'),('fr','messages:apihelp-filerevert-param-archivename','s:45:\"Nom d’archive de la révision à rétablir.\";'),('fr','messages:apihelp-filerevert-param-comment','s:28:\"Téléverser le commentaire.\";'),('fr','messages:apihelp-filerevert-param-filename','s:45:\"Nom de fichier cible, sans le préfixe File:.\";'),('fr','messages:apihelp-filerevert-summary','s:47:\"Rétablir un fichier dans une ancienne version.\";'),('fr','messages:apihelp-format-example-generic','s:55:\"Renvoyer le résultat de la requête dans le format $1.\";'),('fr','messages:apihelp-format-param-wrappedhtml','s:106:\"Renvoyer le HTML avec une jolie mise en forme et les modules ResourceLoader associés comme un objet JSON.\";'),('fr','messages:apihelp-help-example-help','s:39:\"Aide pour le module d’aide lui-même.\";'),('fr','messages:apihelp-help-example-main','s:29:\"Aide pour le module principal\";'),('fr','messages:apihelp-help-example-query','s:41:\"Aide pour deux sous-modules de recherche.\";'),('fr','messages:apihelp-help-example-recursive','s:28:\"Toute l’aide sur une page.\";'),('fr','messages:apihelp-help-example-submodules','s:59:\"Aide pour <kbd>action=query</kbd> et tous ses sous-modules.\";'),('fr','messages:apihelp-help-param-helpformat','s:29:\"Format de sortie de l’aide.\";'),('fr','messages:apihelp-help-param-modules','s:190:\"Modules pour lesquels afficher l’aide (valeurs des paramètres <var>action</var> et <var>format</var>, ou <kbd>main</kbd>). Les sous-modules peuvent être spécifiés avec un <kbd>+</kbd>.\";'),('fr','messages:apihelp-help-param-recursivesubmodules','s:60:\"Inclure l’aide pour les sous-modules de façon récursive.\";'),('fr','messages:apihelp-help-param-submodules','s:56:\"Inclure l’aide pour les sous-modules du module nommé.\";'),('fr','messages:apihelp-help-param-toc','s:52:\"Inclure une table des matières dans la sortie HTML.\";'),('fr','messages:apihelp-help-param-wrap','s:61:\"Inclut la sortie dans une structure standard de réponse API.\";'),('fr','messages:apihelp-help-summary','s:47:\"Afficher l’aide pour les modules spécifiés.\";'),('fr','messages:apihelp-imagerotate-example-generator','s:86:\"Faire pivoter toutes les images de <kbd>Category:Flip</kbd> de <kbd>180</kbd> degrés.\";'),('fr','messages:apihelp-imagerotate-example-simple','s:67:\"Faire pivoter <kbd>File:Example.png</kbd> de <kbd>90</kbd> degrés.\";'),('fr','messages:apihelp-imagerotate-param-rotation','s:75:\"Degrés de rotation de l’image dans le sens des aiguilles d’une montre.\";'),('fr','messages:apihelp-imagerotate-param-tags','s:71:\"Balises à appliquer à l’entrée dans le journal de téléversement.\";'),('fr','messages:apihelp-imagerotate-summary','s:38:\"Faire pivoter une ou plusieurs images.\";'),('fr','messages:apihelp-import-example-import','s:92:\"Importer [[meta:Help:ParserFunctions]] vers l’espace de noms 100 avec tout l’historique.\";'),('fr','messages:apihelp-import-extended-description','s:189:\"Noter que le POST HTTP doit être effectué comme un import de fichier (c’est-à-dire en utilisant multipart/form-data) lors de l’envoi d’un fichier pour le paramètre <var>xml</var>.\";'),('fr','messages:apihelp-import-param-assignknownusers','s:98:\"Affecter les modifications aux utilisateurs locaux quand l’utilisateur nommé existe localement.\";'),('fr','messages:apihelp-import-param-fullhistory','s:101:\"Pour les importations interwiki : importer tout l’historique, et pas seulement la version courante.\";'),('fr','messages:apihelp-import-param-interwikipage','s:51:\"Pour les importations interwiki : page à importer.\";'),('fr','messages:apihelp-import-param-interwikiprefix','s:187:\"Pour les importations téléchargées : le préfixe interwiki à appliquer aux noms d’utilisateur inconnus (et aux utilisateurs connus si <var>$1assignknownusers</var> est positionné).\";'),('fr','messages:apihelp-import-param-interwikisource','s:62:\"Pour les importations interwiki : wiki depuis lequel importer.\";'),('fr','messages:apihelp-import-param-namespace','s:84:\"Importer vers cet espace de noms. Impossible à utiliser avec <var>$1rootpage</var>.\";'),('fr','messages:apihelp-import-param-rootpage','s:95:\"Importer comme une sous-page de cette page. Impossible à utiliser avec <var>$1namespace</var>.\";'),('fr','messages:apihelp-import-param-summary','s:54:\"Résumé de l’importation de l’entrée de journal.\";'),('fr','messages:apihelp-import-param-tags','s:116:\"Modifier les balises à appliquer à l\'entrée du journal d\'importation et à la version zéro des pages importées.\";'),('fr','messages:apihelp-import-param-templates','s:74:\"Pour les importations interwiki : importer aussi tous les modèles inclus.\";'),('fr','messages:apihelp-import-param-xml','s:25:\"Fichier XML téléversé.\";'),('fr','messages:apihelp-import-summary','s:65:\"Importer une page depuis un autre wiki, ou depuis un fichier XML.\";'),('fr','messages:apihelp-json-param-ascii','s:167:\"Si spécifié, encode toutes ses séquences d’échappement non ASCII utilisant l’hexadécimal. Valeur par défaut quand <var>formatversion</var> vaut <kbd>1</kbd>.\";'),('fr','messages:apihelp-json-param-callback','s:167:\"Si spécifié, inclut la sortie dans l’appel d’une fonction fournie. Pour plus de sûreté, toutes les données spécifiques à l’utilisateur seront restreintes.\";'),('fr','messages:apihelp-json-param-formatversion','s:296:\"Mise en forme de sortie :\n;1:Format rétro-compatible (booléens de style XML, clés <samp>*</samp> pour les nœuds de contenu, etc.).\n;2:Format moderne expérimental. Des détails peuvent changer !\n;latest:Utilise le dernier format (actuellement <kbd>2</kbd>), peut changer sans avertissement.\";'),('fr','messages:apihelp-json-param-utf8','s:235:\"Si spécifié, encode la plupart (mais pas tous) des caractères non ASCII en URF-8 au lieu de les remplacer par leur séquence d’échappement hexadécimale. Valeur par défaut quand <var>formatversion</var> ne vaut pas <kbd>1</kbd>.\";'),('fr','messages:apihelp-json-summary','s:37:\"Extraire les données au format JSON.\";'),('fr','messages:apihelp-jsonfm-summary','s:67:\"Extraire les données au format JSON (affiché proprement en HTML).\";'),('fr','messages:apihelp-link','s:25:\"[[Special:ApiHelp/$1|$2]]\";'),('fr','messages:apihelp-linkaccount-example-link','s:74:\"Commencer le processus de liaison d’un compte depuis <kbd>Exemple</kbd>.\";'),('fr','messages:apihelp-linkaccount-summary','s:66:\"Lier un compte d’un fournisseur tiers à l’utilisateur actuel.\";'),('fr','messages:apihelp-login-example-gettoken','s:33:\"Récupérer un jeton de connexion\";'),('fr','messages:apihelp-login-example-login','s:12:\"Se connecter\";'),('fr','messages:apihelp-login-extended-description','s:312:\"Cette action ne devrait être utilisée qu’en lien avec [[Special:BotPasswords]] ; l’utiliser pour la connexion du compte principal est désuet et peut échouer sans avertissement. Pour se connecter sans problème au compte principal, utiliser <kbd>[[Special:ApiHelp/clientlogin|action=clientlogin]]</kbd>.\";'),('fr','messages:apihelp-login-extended-description-nobotpasswords','s:165:\"Cette action est désuète et peut échouer sans prévenir. Pour se connecter sans problème, utiliser <kbd>[[Special:ApiHelp/clientlogin|action=clientlogin]]</kbd>.\";'),('fr','messages:apihelp-login-param-domain','s:21:\"Domaine (facultatif).\";'),('fr','messages:apihelp-login-param-name','s:20:\"Nom d’utilisateur.\";'),('fr','messages:apihelp-login-param-password','s:13:\"Mot de passe.\";'),('fr','messages:apihelp-login-param-token','s:51:\"Jeton de connexion obtenu à la première requête.\";'),('fr','messages:apihelp-login-summary','s:67:\"Reconnecte et récupère les témoins (cookies) d\'authentification.\";'),('fr','messages:apihelp-logout-example-logout','s:36:\"Déconnecter l’utilisateur actuel.\";'),('fr','messages:apihelp-logout-summary','s:51:\"Se déconnecter et effacer les données de session.\";'),('fr','messages:apihelp-main-extended-description','s:1323:\"<div class=\"hlist plainlinks api-main-links\">\n* [[mw:Special:MyLanguage/API:Main_page|Documentation]]\n* [[mw:Special:MyLanguage/API:FAQ|FAQ]]\n* [https://lists.wikimedia.org/mailman/listinfo/mediawiki-api Liste de diffusion]\n* [https://lists.wikimedia.org/mailman/listinfo/mediawiki-api-announce Annonces de l’API]\n* [https://phabricator.wikimedia.org/maniphest/query/GebfyV4uCaLd/#R Bogues et demandes]\n</div>\n<strong>État :</strong> L’API MédiaWiki est une interface stable et mature qui est supportée et améliorée de façon active. Bien que nous essayions de l’éviter, nous pouvons avoir parfois besoin de faire des modifications impactantes ; inscrivez-vous à [https://lists.wikimedia.org/pipermail/mediawiki-api-announce/ la liste de diffusion mediawiki-api-announce] pour être informé des mises à jour.\n\n<strong>Requêtes erronées :</strong> Si des requêtes erronées sont envoyées à l’API, un entête HTTP sera renvoyé avec la clé « MediaWiki-API-Error ». La valeur de cet entête et le code d’erreur renvoyé prendront la même valeur. Pour plus d’information, voyez [[mw:Special:MyLanguage/API:Errors_and_warnings|API: Errors and warnings]].\n\n<p class=\"mw-apisandbox-link\"><strong>Test :</strong> Pour faciliter le test des requêtes de l’API, voyez [[Special:ApiSandbox]].</p>\";'),('fr','messages:apihelp-main-param-action','s:24:\"Quelle action effectuer.\";'),('fr','messages:apihelp-main-param-assert','s:183:\"Vérifier si l’utilisateur est connecté si la valeur est <kbd>user</kbd>, ou s’il a le droit d’un utilisateur robot si la valeur est <kbd>bot</kbd><!-- {{int:group-bot}} ? -->.\";'),('fr','messages:apihelp-main-param-assertuser','s:64:\"Vérifier que l’utilisateur actuel est l’utilisateur nommé.\";'),('fr','messages:apihelp-main-param-curtimestamp','s:48:\"Inclure l’horodatage actuel dans le résultat.\";'),('fr','messages:apihelp-main-param-errorformat','s:417:\"Format à utiliser pour la sortie du texte d’avertissement et d’erreur.\n; plaintext: Wikitexte avec balises HTML supprimées et les entités remplacées.\n; wikitext: wikitexte non analysé.\n; html: HTML.\n; raw: Clé de message et paramètres.\n; none: Aucune sortie de texte, uniquement les codes erreur.\n; bc: Format utilisé avant MédiaWiki 1.29. <var>errorlang</var> et <var>errorsuselocal</var> sont ignorés.\";'),('fr','messages:apihelp-main-param-errorlang','s:385:\"Langue à utiliser pour les avertissements et les erreurs. <kbd>[[Special:ApiHelp/query+siteinfo|action=query&meta=siteinfo]]</kbd> avec <kbd>siprop=languages</kbd> renvoyant une liste de codes de langue, ou spécifier <kbd>content</kbd> pour utiliser la langue du contenu de ce wiki, ou spécifier <kbd>uselang</kbd> pour utiliser la même valeur que le paramètre <var>uselang</var>.\";'),('fr','messages:apihelp-main-param-errorsuselocal','s:129:\"S’il est fourni, les textes d’erreur utiliseront des messages adaptés à la langue dans l’espace de noms {{ns:MediaWiki}}.\";'),('fr','messages:apihelp-main-param-format','s:20:\"Le format de sortie.\";'),('fr','messages:apihelp-main-param-maxage','s:134:\"Fixer l’entête HTTP de contrôle de cache <code>max-age</code> à ce nombre de secondes. Les erreurs ne sont jamais mises en cache.\";'),('fr','messages:apihelp-main-param-maxlag','s:613:\"La latence maximale peut être utilisée quand MédiaWiki est installé sur un cluster de base de données répliqué. Pour éviter des actions provoquant un supplément de latence de réplication de site, ce paramètre peut faire attendre le client jusqu’à ce que la latence de réplication soit inférieure à une valeur spécifiée. En cas de latence excessive, le code d’erreur <samp>maxlag</samp> est renvoyé avec un message tel que <samp>Attente de $host : $lag secondes de délai</samp>.<br />Voyez [[mw:Special:MyLanguage/Manual:Maxlag_parameter|Manuel: Maxlag parameter]] pour plus d’information.\";'),('fr','messages:apihelp-main-param-origin','s:1149:\"En accédant à l’API en utilisant une requête AJAX inter-domaines (CORS), mettre le domaine d’origine dans ce paramètre. Il doit être inclus dans toute requête de pre-flight, et doit donc faire partie de l’URI de la requête (pas du corps du POST).\n\nPour les requêtes authentifiées, il doit correspondre exactement à une des origines dans l’entête <code>Origin</code> header, donc il doit être fixé avec quelque chose comme <kbd>https://en.wikipedia.org</kbd> ou <kbd>https://meta.wikimedia.org</kbd>. Si ce paramètre ne correspond pas à l’entête <code>Origin</code>, une réponse 403 sera renvoyée. Si ce paramètre correspond à l’entête <code>Origin</code> et que l’origine est en liste blanche, des entêtes <code>Access-Control-Allow-Origin</code> et <code>Access-Control-Allow-Credentials</code> seront positionnés.\n\nPour les requêtes non authentifiées, spécifiez la valeur <kbd>*</kbd>. Cela positionnera l’entête <code>Access-Control-Allow-Origin</code>, mais <code>Access-Control-Allow-Credentials</code> vaudra <code>false</code> et toutes les données spécifiques à l’utilisateur seront filtrées.\";'),('fr','messages:apihelp-main-param-requestid','s:105:\"Toute valeur fournie ici sera incluse dans la réponse. Peut être utilisé pour distinguer des demandes.\";'),('fr','messages:apihelp-main-param-responselanginfo','s:97:\"Inclure les langues utilisées pour <var>uselang</var> et <var>errorlang</var> dans le résultat.\";'),('fr','messages:apihelp-main-param-servedby','s:72:\"Inclure le nom d’hôte qui a renvoyé la requête dans les résultats.\";'),('fr','messages:apihelp-main-param-smaxage','s:135:\"Fixer l’entête HTTP de contrôle de cache <code>s-maxage</code> à ce nombre de secondes. Les erreurs ne sont jamais mises en cache.\";'),('fr','messages:apihelp-main-param-uselang','s:381:\"Langue à utiliser pour les traductions de message. <kbd>[[Special:ApiHelp/query+siteinfo|action=query&meta=siteinfo]]</kbd> avec <kbd>siprop=languages</kbd> renvoie une liste de codes de langue, ou en spécifiant <kbd>user</kbd> pour utiliser la préférence de langue de l’utilisateur actuel, ou en spécifiant <kbd>content</kbd> pour utiliser le langage du contenu de ce wiki.\";'),('fr','messages:apihelp-main-summary','s:0:\"\";'),('fr','messages:apihelp-managetags-example-activate','s:94:\"Activer une balise nommée <kbd>spam</kbd> avec le motif <kbd>For use in edit patrolling</kbd>\";'),('fr','messages:apihelp-managetags-example-create','s:93:\"Créer une balise nommée <kbd>spam</kbd> avec le motif <kbd>For use in edit patrolling</kbd>\";'),('fr','messages:apihelp-managetags-example-deactivate','s:90:\"Désactiver une balise nommée <kbd>spam</kbd> avec le motif <kbd>No longer required</kbd>\";'),('fr','messages:apihelp-managetags-example-delete','s:74:\"Supprimer la balise <kbd>vandlaism</kbd> avec le motif <kbd>Misspelt</kbd>\";'),('fr','messages:apihelp-managetags-param-ignorewarnings','s:83:\"S’il faut ignorer tout avertissement qui surviendrait au cours de l’opération.\";'),('fr','messages:apihelp-managetags-param-operation','s:547:\"Quelle opération effectuer :\n;create:Créer une nouvelle balise de modification pour un usage manuel.\n;delete:Supprimer une balise de modification de la base de données, y compris la suppression de la marque de toutes les révisions, entrées de modification récente et entrées de journal dans lesquelles elle serait utilisée.\n;activate:Activer une balise de modification, permettant aux utilisateurs de l’appliquer manuellement.\n;deactivate:Désactiver une balise de modification, empêchant les utilisateurs de l’appliquer manuellement.\";'),('fr','messages:apihelp-managetags-param-reason','s:77:\"Un motif facultatif pour créer, supprimer, activer ou désactiver la balise.\";'),('fr','messages:apihelp-managetags-param-tag','s:347:\"Balise à créer, supprimer, activer ou désactiver. Pour la création de balise, elle ne doit pas exister. Pour la suppression de balise, elle doit exister. Pour l’activation de balise, elle doit exister et ne pas être utilisée par une extension. Pour la désactivation de balise, elle doit être actuellement active et définie manuellement.\";'),('fr','messages:apihelp-managetags-param-tags','s:83:\"Modifier les balises à appliquer à l’entrée du journal de gestion des balises.\";'),('fr','messages:apihelp-managetags-summary','s:74:\"Effectuer des tâches de gestion relatives à la modification des balises.\";'),('fr','messages:apihelp-mergehistory-example-merge','s:90:\"Fusionner l’historique complet de  <kbd>AnciennePage</kbd> dans <kbd>NouvellePage</kbd>.\";'),('fr','messages:apihelp-mergehistory-example-merge-timestamp','s:132:\"Fusionner les révisions de la page <kbd>AnciennePage</kbd> jusqu’au <kbd>2015-12-31T04:37:41Z</kbd> dans <kbd>NouvellePage</kbd>.\";'),('fr','messages:apihelp-mergehistory-param-from','s:112:\"Titre de la page depuis laquelle l’historique sera fusionné. Impossible à utiliser avec <var>$1fromid</var>.\";'),('fr','messages:apihelp-mergehistory-param-fromid','s:107:\"ID de la page depuis laquelle l’historique sera fusionné. Impossible à utiliser avec <var>$1from</var>.\";'),('fr','messages:apihelp-mergehistory-param-reason','s:37:\"Raison pour fusionner l’historique.\";'),('fr','messages:apihelp-mergehistory-param-timestamp','s:250:\"Horodatage jusqu’auquel les révisions seront déplacées de l’historique de la page source vers l’historique de la page de destination. S’il est omis, tout l’historique de la page source sera fusionné avec celui de la page de destination.\";'),('fr','messages:apihelp-mergehistory-param-to','s:108:\"Titre de la page vers laquelle l’historique sera fusionné. Impossible à utiliser avec <var>$1toid</var>.\";'),('fr','messages:apihelp-mergehistory-param-toid','s:103:\"ID de la page vers laquelle l’historique sera fusionné. Impossible à utiliser avec <var>$1to</var>.\";'),('fr','messages:apihelp-mergehistory-summary','s:36:\"Fusionner les historiques des pages.\";'),('fr','messages:apihelp-move-example-move','s:80:\"Renommer <kbd>Badtitle</kbd> en <kbd>Goodtitle</kbd> sans garder de redirection.\";'),('fr','messages:apihelp-move-param-from','s:82:\"Titre de la page à renommer. Impossible de l’utiliser avec <var>$1fromid</var>.\";'),('fr','messages:apihelp-move-param-fromid','s:73:\"ID de la page à renommer. Impossible à utiliser avec <var>$1from</var>.\";'),('fr','messages:apihelp-move-param-ignorewarnings','s:32:\"Ignorer tous les avertissements.\";'),('fr','messages:apihelp-move-param-movesubpages','s:42:\"Renommer les sous-pages, le cas échéant.\";'),('fr','messages:apihelp-move-param-movetalk','s:47:\"Renommer la page de discussion, si elle existe.\";'),('fr','messages:apihelp-move-param-noredirect','s:30:\"Ne pas créer une redirection.\";'),('fr','messages:apihelp-move-param-reason','s:19:\"Motif du renommage.\";'),('fr','messages:apihelp-move-param-tags','s:122:\"Modifier les balises à appliquer à l\'entrée du journal des renommages et à la version zéro de la page de destination.\";'),('fr','messages:apihelp-move-param-to','s:25:\"Nouveau titre de la page.\";'),('fr','messages:apihelp-move-param-unwatch','s:81:\"Supprimer la page et la redirection de la liste de suivi de l\'utilisateur actuel.\";'),('fr','messages:apihelp-move-param-watch','s:80:\"Ajouter la page et la redirection, à la liste de suivi de l\'utilisateur actuel.\";'),('fr','messages:apihelp-move-param-watchlist','s:144:\"Ajouter ou supprimer sans condition la page de la liste de suivi de l\'utilisateur actuel, utiliser les préférences ou ne pas changer le suivi.\";'),('fr','messages:apihelp-move-summary','s:19:\"Déplacer une page.\";'),('fr','messages:apihelp-no-such-module','s:39:\"Le module « $1 » est introuvable.\";'),('fr','messages:apihelp-none-summary','s:17:\"Ne rien extraire.\";'),('fr','messages:apihelp-opensearch-example-te','s:48:\"Trouver les pages commençant par <kbd>Te</kbd>.\";'),('fr','messages:apihelp-opensearch-param-format','s:20:\"Le format de sortie.\";'),('fr','messages:apihelp-opensearch-param-limit','s:41:\"Nombre maximal de résultats à renvoyer.\";'),('fr','messages:apihelp-opensearch-param-namespace','s:115:\"Espaces de nom à rechercher.  Ignoré if <var>$1search</var> commence avec le préfixe d\'un espace de noms valide.\";'),('fr','messages:apihelp-opensearch-param-redirects','s:289:\"Comment gérer les redirections :\n;return:Renvoie la redirection elle-même.\n;resolve:Renvoie la page cible. Peut renvoyer moins de $1limit résultats.\nPour des raisons historiques, la valeur par défaut est « return » pour $1format=json et « resolve » pour les autres formats.\";'),('fr','messages:apihelp-opensearch-param-search','s:33:\"Chaîne de caractères cherchée.\";'),('fr','messages:apihelp-opensearch-param-suggest','s:125:\"Ne rien faire si <var>[[mw:Special:MyLanguage/Manual:$wgEnableOpenSearchSuggest|$wgEnableOpenSearchSuggest]]</var> vaut faux.\";'),('fr','messages:apihelp-opensearch-param-warningsaserror','s:115:\"Si des avertissements apparaissent avec <kbd>format=json</kbd>, renvoyer une erreur d’API au lieu de les ignorer.\";'),('fr','messages:apihelp-opensearch-summary','s:61:\"Rechercher dans le wiki en utilisant le protocole OpenSearch.\";'),('fr','messages:apihelp-options-example-change','s:67:\"Modifier les préférences <kbd>skin</kbd> et <kbd>hideminor</kbd>.\";'),('fr','messages:apihelp-options-example-complex','s:94:\"Réinitialiser toutes les préférences, puis définir <kbd>skin</kbd> et <kbd>nickname</kbd>.\";'),('fr','messages:apihelp-options-example-reset','s:39:\"Réinitialiser toutes les préférences\";'),('fr','messages:apihelp-options-extended-description','s:238:\"Seules les options enregistrées dans le cœur ou dans l’une des extensions installées, ou les options avec des clés préfixées par <code>userjs-</code> (devant être utilisées dans les scripts utilisateur), peuvent être définies.\";'),('fr','messages:apihelp-options-param-change','s:426:\"Liste des modifications, au format nom=valeur (par ex. skin=vector). Si aucune valeur n’est fournie (pas même un signe égal), par ex., nomoption|autreoption|…, l’option sera réinitialisée à sa valeur par défaut. Pour toute valeur passée contenant une barre verticale (<kbd>|</kbd>), utiliser le [[Special:ApiHelp/main#main/datatypes|séparateur alternatif de valeur multiple]] pour que l\'opération soit correcte.\";'),('fr','messages:apihelp-options-param-optionname','s:94:\"Nom de l’option qui doit être définie avec la valeur fournie par <var>$1optionvalue</var>.\";'),('fr','messages:apihelp-options-param-optionvalue','s:62:\"La valeur de l\'option spécifiée par <var>$1optionname</var>.\";'),('fr','messages:apihelp-options-param-reset','s:69:\"Réinitialise les préférences avec les valeurs par défaut du site.\";'),('fr','messages:apihelp-options-param-resetkinds','s:94:\"Liste des types d’option à réinitialiser quand l’option <var>$1reset</var> est définie.\";'),('fr','messages:apihelp-options-summary','s:52:\"Modifier les préférences de l\'utilisateur courant.\";'),('fr','messages:apihelp-paraminfo-example-1','s:284:\"Afficher les informations pour <kbd>[[Special:ApiHelp/parse|action=parse]]</kbd>, <kbd>[[Special:ApiHelp/jsonfm|format=jsonfm]]</kbd>, <kbd>[[Special:ApiHelp/query+allpages|action=query&list=allpages]]</kbd> et <kbd>[[Special:ApiHelp/query+siteinfo|action=query&meta=siteinfo]]</kbd>.\";'),('fr','messages:apihelp-paraminfo-example-2','s:106:\"Afficher les informations pour tous les sous-modules de <kbd>[[Special:ApiHelp/query|action=query]]</kbd>.\";'),('fr','messages:apihelp-paraminfo-param-formatmodules','s:122:\"Liste des noms de module de mise en forme (valeur du paramètre <var>format</var>). Utiliser plutôt <var>$1modules</var>.\";'),('fr','messages:apihelp-paraminfo-param-helpformat','s:29:\"Format des chaînes d’aide.\";'),('fr','messages:apihelp-paraminfo-param-mainmodule','s:119:\"Obtenir aussi des informations sur le module principal (niveau supérieur). Utiliser plutôt <kbd>$1modules=main</kbd>.\";'),('fr','messages:apihelp-paraminfo-param-modules','s:271:\"Liste des noms de module (valeurs des paramètres <var>action</var> et <var>format</var>, ou <kbd>main</kbd>). Peut spécifier des sous-modules avec un <kbd>+</kbd>, ou tous les sous-modules avec <kbd>+*</kbd>, ou tous les sous-modules récursivement avec <kbd>+**</kbd>.\";'),('fr','messages:apihelp-paraminfo-param-pagesetmodule','s:90:\"Obtenir aussi des informations sur le module pageset (en fournissant titles= et ses amis).\";'),('fr','messages:apihelp-paraminfo-param-querymodules','s:198:\"Liste des noms des modules de requête (valeur des paramètres <var>prop</var>, <var>meta</var> ou <var>list</var>). Utiliser <kbd>$1modules=query+foo</kbd> au lieu de <kbd>$1querymodules=foo</kbd>.\";'),('fr','messages:apihelp-paraminfo-summary','s:52:\"Obtenir des informations sur les modules de l’API.\";'),('fr','messages:apihelp-parse-example-page','s:18:\"Analyser une page.\";'),('fr','messages:apihelp-parse-example-summary','s:21:\"Analyser un résumé.\";'),('fr','messages:apihelp-parse-example-text','s:22:\"Analyser le wikitexte.\";'),('fr','messages:apihelp-parse-example-texttitle','s:58:\"Analyser du wikitexte, en spécifiant le titre de la page.\";'),('fr','messages:apihelp-parse-extended-description','s:550:\"Voyez les différents modules prop de <kbd>[[Special:ApiHelp/query|action=query]]</kbd> pour avoir de l’information sur la version actuelle d’une page.\n\nIl y a plusieurs moyens de spécifier le texte à analyser :\n# Spécifier une page ou une révision, en utilisant <var>$1page</var>, <var>$1pageid</var> ou <var>$1oldid</var>.\n# Spécifier explicitement un contenu, en utilisant <var>$1text</var>, <var>$1title</var> et <var>$1contentmodel</var>.\n# Spécifier uniquement un résumé à analyser. <var>$1prop</var> doit recevoir une valeur vide.\";'),('fr','messages:apihelp-parse-param-contentformat','s:114:\"Format de sérialisation du contenu utilisé pour le texte d’entrée. Valide uniquement si utilisé avec $1text.\";'),('fr','messages:apihelp-parse-param-contentmodel','s:188:\"Modèle de contenu du texte d’entrée. Si omis, $1title doit être spécifié, et la valeur par défaut sera le modèle du titre spécifié. Valide uniquement quand utilisé avec $1text.\";'),('fr','messages:apihelp-parse-param-disableeditsection','s:75:\"Omettre les liens de modification de section de la sortie de l’analyseur.\";'),('fr','messages:apihelp-parse-param-disablelimitreport','s:103:\"Omettre le rapport de limite (« rapport de limite du nouveau PP ») de la sortie de l’analyseur.\";'),('fr','messages:apihelp-parse-param-disablepp','s:53:\"Utiliser <var>$1disablelimitreport</var> à la place.\";'),('fr','messages:apihelp-parse-param-disablestylededuplication','s:79:\"Ne pas dupliquer les feuilles de style incluses, dans la sortie de l\'analyseur.\";'),('fr','messages:apihelp-parse-param-disabletidy','s:99:\"Ne pas exécuter de nettoyage du code HTML (par exemple,  réagencer) sur la sortie de l\'analyseur.\";'),('fr','messages:apihelp-parse-param-disabletoc','s:46:\"Omettre la table des matières dans la sortie.\";'),('fr','messages:apihelp-parse-param-effectivelanglinks','s:101:\"Inclut les liens de langue fournis par les extensions (à utiliser avec <kbd>$1prop=langlinks</kbd>).\";'),('fr','messages:apihelp-parse-param-generatexml','s:132:\"Générer un arbre d’analyse XML (nécessite le modèle de contenu <code>$1</code> ; remplacé par <kbd>$2prop=parsetree</kbd>).\";'),('fr','messages:apihelp-parse-param-oldid','s:89:\"Analyser le contenu de cette révision. Écrase <var>$1page</var> et <var>$1pageid</var>.\";'),('fr','messages:apihelp-parse-param-onlypst','s:216:\"Faire une transformation avant enregistrement (PST) de l’entrée, mais ne pas l’analyser. Renvoie le même wikitexte, après que la PST a été appliquée. Valide uniquement quand utilisé avec <var>$1text</var>.\";'),('fr','messages:apihelp-parse-param-page','s:103:\"Analyser le contenu de cette page. Impossible à utiliser avec <var>$1text</var> et <var>$1title</var>.\";'),('fr','messages:apihelp-parse-param-pageid','s:61:\"Analyser le contenu de cette page. Écrase <var>$1page</var>.\";'),('fr','messages:apihelp-parse-param-preview','s:25:\"Analyser en mode aperçu.\";'),('fr','messages:apihelp-parse-param-prop','s:30:\"Quelles informations obtenir :\";'),('fr','messages:apihelp-parse-param-pst','s:131:\"Faire une transformation avant enregistrement de l’entrée avant de l’analyser. Valide uniquement quand utilisé avec du texte.\";'),('fr','messages:apihelp-parse-param-redirects','s:108:\"Si le paramètre <var>$1page</var> ou <var>$1pageid</var> est positionné sur une redirection, la résoudre.\";'),('fr','messages:apihelp-parse-param-revid','s:98:\"ID de révision, pour <code><nowiki>{{REVISIONID}}</nowiki></code> et autres variables semblables.\";'),('fr','messages:apihelp-parse-param-section','s:299:\"Traiter uniquement le contenu de la section ayant ce numéro.\n\nQuand la valeur est <kbd>new</kbd>, traite <var>$1text</var> et <var>$1sectiontitle</var> comme s’ils correspondaient à une nouvelle section de la page.\n\nLa valeur <kbd>new</kbd> n’est autorisée que si <var>text</var> est défini.\";'),('fr','messages:apihelp-parse-param-sectionpreview','s:67:\"Analyser en mode aperçu de section (active aussi le mode aperçu).\";'),('fr','messages:apihelp-parse-param-sectiontitle','s:190:\"Nouveau titre de section quand <var>section</var> vaut <kbd>nouveau</kbd>.\n\nÀ la différence de la modification de page, cela ne revient pas à <var>summary</var> quand il est omis ou vide.\";'),('fr','messages:apihelp-parse-param-summary','s:21:\"Résumé à analyser.\";'),('fr','messages:apihelp-parse-param-text','s:114:\"Texte à analyser. utiliser <var>$1title</var> ou <var>$1contentmodel</var> pour contrôler le modèle de contenu.\";'),('fr','messages:apihelp-parse-param-title','s:145:\"Titre de la page à laquelle appartient le texte. Si omis, <var>$1contentmodel</var> doit être spécifié, et [[API]] sera utilisé comme titre.\";'),('fr','messages:apihelp-parse-param-useskin','s:229:\"Appliquer l’habillage sélectionné sur la sortie de l’analyseur. Cela peut affecter les propriétés suivantes : <kbd>langlinks</kbd>, <kbd>headitems</kbd>, <kbd>modules</kbd>, <kbd>jsconfigvars</kbd>, <kbd>indicators</kbd>.\";'),('fr','messages:apihelp-parse-param-wrapoutputclass','s:62:\"classe CSS à utiliser pour formater la sortie de l\'analyseur.\";'),('fr','messages:apihelp-parse-paramvalue-prop-categories','s:51:\"Fournit les catégories dans le wikitexte analysé.\";'),('fr','messages:apihelp-parse-paramvalue-prop-categorieshtml','s:40:\"Fournit la version HTML des catégories.\";'),('fr','messages:apihelp-parse-paramvalue-prop-displaytitle','s:38:\"Ajoute le titre du wikitexte analysé.\";'),('fr','messages:apihelp-parse-paramvalue-prop-encodedjsconfigvars','s:93:\"Fournit les variables de configuration JavaScript spécifiques à la page comme chaîne JSON.\";'),('fr','messages:apihelp-parse-paramvalue-prop-externallinks','s:54:\"Fournit les liens externes dans le wikitexte analysé.\";'),('fr','messages:apihelp-parse-paramvalue-prop-headhtml','s:57:\"Fournit le <code>&lt;head&gt;</code> analysé de la page.\";'),('fr','messages:apihelp-parse-paramvalue-prop-headitems','s:78:\"Fournit les éléments à mettre dans le <code>&lt;head&gt;</code> de la page.\";'),('fr','messages:apihelp-parse-paramvalue-prop-images','s:46:\"Fournit les images dans le wikitexte analysé.\";'),('fr','messages:apihelp-parse-paramvalue-prop-indicators','s:72:\"Fournit le HTML des indicateurs d’état de page utilisés sur la page.\";'),('fr','messages:apihelp-parse-paramvalue-prop-iwlinks','s:56:\"Fournit les liens interwikis dans le wikitexte analysé.\";'),('fr','messages:apihelp-parse-paramvalue-prop-jsconfigvars','s:133:\"Fournit les variables de configuration JavaScript spécifiques à la page. Pour les appliquer, utiliser <code>mw.config.set()</code>.\";'),('fr','messages:apihelp-parse-paramvalue-prop-langlinks','s:50:\"Fournit les liens de langue du wikitexte analysé.\";'),('fr','messages:apihelp-parse-paramvalue-prop-limitreportdata','s:137:\"Fournit le rapport de limite d’une manière structurée. Ne fournit aucune donnée, si <var>$1disablelimitreport</var> est positionné.\";'),('fr','messages:apihelp-parse-paramvalue-prop-limitreporthtml','s:124:\"Fournit la version HTML du rapport de limite. Ne fournit aucune donnée, si <var>$1disablelimitreport</var> est positionné.\";'),('fr','messages:apihelp-parse-paramvalue-prop-links','s:54:\"Fournit les liens internes dans le wikitexte analysé.\";'),('fr','messages:apihelp-parse-paramvalue-prop-modules','s:226:\"Fournit les modules ResourceLoader utilisés sur la page. Pour les charger, utiliser <code>mw.loader.using()</code>. Soit <kbd>jsconfigvars</kbd> soit <kbd>encodedjsconfigvars</kbd> doit être demandé avec <kbd>modules</kbd>.\";'),('fr','messages:apihelp-parse-paramvalue-prop-parsetree','s:103:\"L’arbre d’analyse XML du contenu de la révision (nécessite le modèle de contenu <code>$1</code>)\";'),('fr','messages:apihelp-parse-paramvalue-prop-parsewarnings','s:83:\"Fournit les messages d\'avertissement qui sont apparus lors de l\'analyse de contenu.\";'),('fr','messages:apihelp-parse-paramvalue-prop-properties','s:71:\"Fournit les diverses propriétés définies dans le wikitexte analysé.\";'),('fr','messages:apihelp-parse-paramvalue-prop-revid','s:48:\"Ajoute l’ID de révision de la page analysée.\";'),('fr','messages:apihelp-parse-paramvalue-prop-sections','s:48:\"Fournit les sections dans le wikitexte analysé.\";'),('fr','messages:apihelp-parse-paramvalue-prop-templates','s:48:\"Fournit les modèles dans le wikitexte analysé.\";'),('fr','messages:apihelp-parse-paramvalue-prop-text','s:39:\"Fournit le texte analysé du wikitexte.\";'),('fr','messages:apihelp-parse-paramvalue-prop-wikitext','s:54:\"Fournit le wikitexte d’origine qui a été analysé.\";'),('fr','messages:apihelp-parse-summary','s:60:\"Analyse le contenu et renvoie le résultat de l’analyseur.\";'),('fr','messages:apihelp-patrol-example-rcid','s:37:\"Patrouiller une modification récente\";'),('fr','messages:apihelp-patrol-example-revid','s:25:\"Patrouiller une révision\";'),('fr','messages:apihelp-patrol-param-rcid','s:43:\"ID de modification récente à patrouiller.\";'),('fr','messages:apihelp-patrol-param-revid','s:31:\"ID de révision à patrouiller.\";'),('fr','messages:apihelp-patrol-param-tags','s:81:\"Modifier les balises à appliquer à l’entrée dans le journal de surveillance.\";'),('fr','messages:apihelp-patrol-summary','s:38:\"Patrouiller une page ou une révision.\";'),('fr','messages:apihelp-php-param-formatversion','s:298:\"Mise en forme de la sortie :\n;1:Format rétro-compatible (bool&ens de style XML, clés <samp>*</samp> pour les nœuds de contenu, etc.).\n;2:Format moderne expérimental. Des détails peuvent changer !\n;latest:Utilise le dernier format (actuellement <kbd>2</kbd>), peut changer sans avertissement.\";'),('fr','messages:apihelp-php-summary','s:51:\"Extraire les données au format sérialisé de PHP.\";'),('fr','messages:apihelp-phpfm-summary','s:81:\"Extraire les données au format sérialisé de PHP (affiché proprement en HTML).\";'),('fr','messages:apihelp-protect-example-protect','s:18:\"Protéger une page\";'),('fr','messages:apihelp-protect-example-unprotect','s:143:\"Enlever la protection d’une page en mettant les restrictions à <kbd>all</kbd> (c\'est à dire tout le monde est autorisé à faire l\'action).\";'),('fr','messages:apihelp-protect-example-unprotect2','s:65:\"Enlever la protection de la page en ne mettant aucune restriction\";'),('fr','messages:apihelp-protect-param-cascade','s:214:\"Activer la protection en cascade (c’est-à-dire protéger les modèles transclus et les images utilisés dans cette page). Ignoré si aucun des niveaux de protection fournis ne prend en charge la mise en cascade.\";'),('fr','messages:apihelp-protect-param-expiry','s:237:\"Horodatages d’expiration. Si un seul horodatage est fourni, il sera utilisé pour toutes les protections. Utiliser <kbd>infinite</kbd>, <kbd>indefinite</kbd>, <kbd>infinity</kbd> ou <kbd>never</kbd> pour une protection sans expiration.\";'),('fr','messages:apihelp-protect-param-pageid','s:69:\"ID de la page à (dé)protéger. Impossible à utiliser avec $1title.\";'),('fr','messages:apihelp-protect-param-protections','s:322:\"Liste des niveaux de protection, au format <kbd>action=niveau</kbd> (par exemple  <kbd>edit=sysop</kbd>). Un niveau de <kbd>tout</kbd>, indique que tout le monde est autorisé à faire l\'action, c\'est à dire aucune restriction.\n\n<strong>NOTE :<strong> Toutes les actions non listées auront leur restrictions supprimées.\";'),('fr','messages:apihelp-protect-param-reason','s:25:\"Motif de (dé)protection.\";'),('fr','messages:apihelp-protect-param-tags','s:79:\"Modifier les balises à appliquer à l’entrée dans le journal de protection.\";'),('fr','messages:apihelp-protect-param-title','s:73:\"Titre de la page à (dé)protéger. Impossible à utiliser avec $1pageid.\";'),('fr','messages:apihelp-protect-param-watch','s:89:\"Si activé, ajouter la page (dé)protégée à la liste de suivi de l\'utilisateur actuel.\";'),('fr','messages:apihelp-protect-param-watchlist','s:145:\"Ajouter ou supprimer sans condition la page de la liste de suivi de l\'utilisateur actuel, utiliser les préférences ou ne pas modifier le suivi.\";'),('fr','messages:apihelp-protect-summary','s:46:\"Modifier le niveau de protection d’une page.\";'),('fr','messages:apihelp-purge-example-generator','s:62:\"Purger les 10 premières pages de l’espace de noms principal\";'),('fr','messages:apihelp-purge-example-simple','s:56:\"Purger les pages <kbd>Main Page</kbd> et <kbd>API</kbd>.\";'),('fr','messages:apihelp-purge-param-forcelinkupdate','s:35:\"Mettre à jour les tables de liens.\";'),('fr','messages:apihelp-purge-param-forcerecursivelinkupdate','s:125:\"Mettre à jour la table des liens, et mettre à jour les tables de liens pour toute page qui utilise cette page comme modèle\";'),('fr','messages:apihelp-purge-summary','s:34:\"Vider le cache des titres fournis.\";'),('fr','messages:apihelp-query+allcategories-example-generator','s:118:\"Récupérer l’information sur la page de catégorie elle-même pour les catégories commençant par <kbd>List</kbd>.\";'),('fr','messages:apihelp-query+allcategories-example-size','s:79:\"Lister les catégories avec l’information sur le nombre de pages dans chacune\";'),('fr','messages:apihelp-query+allcategories-param-dir','s:24:\"Ordre dans lequel trier.\";'),('fr','messages:apihelp-query+allcategories-param-from','s:58:\"La catégorie depuis laquelle démarrer l’énumération.\";'),('fr','messages:apihelp-query+allcategories-param-limit','s:32:\"Combien de catégories renvoyer.\";'),('fr','messages:apihelp-query+allcategories-param-max','s:70:\"Renvoyer uniquement les catégories avec au plus ce nombre de membres.\";'),('fr','messages:apihelp-query+allcategories-param-min','s:71:\"Renvoyer uniquement les catégories avec au moins ce nombre de membres.\";'),('fr','messages:apihelp-query+allcategories-param-prefix','s:74:\"Rechercher tous les titres de catégorie qui commencent avec cette valeur.\";'),('fr','messages:apihelp-query+allcategories-param-prop','s:34:\"Quelles propriétés récupérer :\";'),('fr','messages:apihelp-query+allcategories-param-to','s:53:\"La catégorie à laquelle terminer l’énumération.\";'),('fr','messages:apihelp-query+allcategories-paramvalue-prop-hidden','s:82:\"Marque les catégories qui sont masquées avec <code>_&#95;HIDDENCAT_&#95;</code>.\";'),('fr','messages:apihelp-query+allcategories-paramvalue-prop-size','s:45:\"Ajoute le nombre de pages dans la catégorie.\";'),('fr','messages:apihelp-query+allcategories-summary','s:34:\"Énumérer toutes les catégories.\";'),('fr','messages:apihelp-query+alldeletedrevisions-example-ns-main','s:82:\"Lister les 50 premières révisions supprimées dans l’espace de noms principal.\";'),('fr','messages:apihelp-query+alldeletedrevisions-example-user','s:88:\"Lister les 50 dernières contributions supprimées par l\'utilisateur <kbd>Example</kbd>.\";'),('fr','messages:apihelp-query+alldeletedrevisions-param-end','s:49:\"L’horodatage auquel arrêter l’énumération.\";'),('fr','messages:apihelp-query+alldeletedrevisions-param-excludeuser','s:49:\"Ne pas lister les révisions par cet utilisateur.\";'),('fr','messages:apihelp-query+alldeletedrevisions-param-from','s:31:\"Démarrer la liste à ce titre.\";'),('fr','messages:apihelp-query+alldeletedrevisions-param-generatetitles','s:83:\"Utilisé comme générateur, générer des titres plutôt que des IDs de révision.\";'),('fr','messages:apihelp-query+alldeletedrevisions-param-miser-user-namespace','s:324:\"<strong>REMARQUE :</strong> du fait du [[mw:Special:MyLanguage/Manual:$wgMiserMode|mode minimal]], utiliser <var>$1user</var> et <var>$1namespace</var> ensemble peut aboutir à avoir moins de résultats renvoyés que <var>$1limit</var> avant de continuer ; dans les cas extrêmes, zéro résultats peuvent être renvoyés.\";'),('fr','messages:apihelp-query+alldeletedrevisions-param-namespace','s:52:\"Lister uniquement les pages dans cet espace de noms.\";'),('fr','messages:apihelp-query+alldeletedrevisions-param-prefix','s:64:\"Rechercher tous les titres de page commençant par cette valeur.\";'),('fr','messages:apihelp-query+alldeletedrevisions-param-start','s:50:\"L’horodatage auquel démarrer l’énumération.\";'),('fr','messages:apihelp-query+alldeletedrevisions-param-tag','s:61:\"Lister uniquement les révisions marquées avec cette balise.\";'),('fr','messages:apihelp-query+alldeletedrevisions-param-to','s:30:\"Arrêter la liste à ce titre.\";'),('fr','messages:apihelp-query+alldeletedrevisions-param-user','s:53:\"Lister uniquement les révisions par cet utilisateur.\";'),('fr','messages:apihelp-query+alldeletedrevisions-paraminfo-nonuseronly','s:46:\"Impossible à utiliser avec <var>$3user</var>.\";'),('fr','messages:apihelp-query+alldeletedrevisions-paraminfo-useronly','s:45:\"Utilisable uniquement avec <var>$3user</var>.\";'),('fr','messages:apihelp-query+alldeletedrevisions-summary','s:86:\"Lister toutes les révisions supprimées par un utilisateur ou dans un espace de noms.\";'),('fr','messages:apihelp-query+allfileusages-example-B','s:135:\"Lister les titres des fichiers, y compris ceux manquants, avec les IDs de page d’où ils proviennent, en commençant à <kbd>B</kbd>.\";'),('fr','messages:apihelp-query+allfileusages-example-generator','s:41:\"Obtient les pages contenant les fichiers.\";'),('fr','messages:apihelp-query+allfileusages-example-unique','s:37:\"Lister les titres de fichier uniques.\";'),('fr','messages:apihelp-query+allfileusages-example-unique-generator','s:62:\"Obtient tous les titres de fichier, en marquant les manquants.\";'),('fr','messages:apihelp-query+allfileusages-param-dir','s:27:\"L\'ordre dans lequel lister.\";'),('fr','messages:apihelp-query+allfileusages-param-from','s:62:\"Le titre du fichier depuis lequel commencer l’énumération.\";'),('fr','messages:apihelp-query+allfileusages-param-limit','s:41:\"Combien d’éléments renvoyer au total.\";'),('fr','messages:apihelp-query+allfileusages-param-prefix','s:69:\"Rechercher tous les fichiers dont le titre commence par cette valeur.\";'),('fr','messages:apihelp-query+allfileusages-param-prop','s:30:\"Quelles informations inclure :\";'),('fr','messages:apihelp-query+allfileusages-param-to','s:54:\"Le titre du fichier auquel arrêter l’énumération.\";'),('fr','messages:apihelp-query+allfileusages-param-unique','s:188:\"Afficher uniquement les titres de fichiers distincts. Impossible à utiliser avec $1prop=ids.\nQuand il est utilisé comme générateur, il produit les pages cible au lieu des pages source.\";'),('fr','messages:apihelp-query+allfileusages-paramvalue-prop-ids','s:69:\"Ajoute l\'ID des pages qui l’utilisent (incompatible avec $1unique).\";'),('fr','messages:apihelp-query+allfileusages-paramvalue-prop-title','s:27:\"Ajoute le titre du fichier.\";'),('fr','messages:apihelp-query+allfileusages-summary','s:76:\"Lister toutes les utilisations de fichiers, y compris ceux n’existant pas.\";'),('fr','messages:apihelp-query+allimages-example-B','s:71:\"Afficher une liste des fichiers commençant par la lettre <kbd>B</kbd>.\";'),('fr','messages:apihelp-query+allimages-example-generator','s:79:\"Afficher l’information sur 4 fichiers commençant par la lettre <kbd>T</kbd>.\";'),('fr','messages:apihelp-query+allimages-example-mimetypes','s:93:\"Afficher une liste de fichiers avec le type MIME <kbd>image/png</kbd> ou <kbd>image/gif</kbd>\";'),('fr','messages:apihelp-query+allimages-example-recent','s:91:\"Afficher une liste de fichiers récemment téléversés, semblable à [[Special:NewFiles]].\";'),('fr','messages:apihelp-query+allimages-param-dir','s:27:\"L\'ordre dans laquel lister.\";'),('fr','messages:apihelp-query+allimages-param-end','s:94:\"L’horodatage de la fin d’énumération. Ne peut être utilisé qu’avec $1sort=timestamp.\";'),('fr','messages:apihelp-query+allimages-param-filterbots','s:148:\"Comment filtrer les fichiers téléversés par des robots. Peut être utilisé uniquement avec $1sort=timestamp. Impossible à utiliser avec $1user.\";'),('fr','messages:apihelp-query+allimages-param-from','s:112:\"Le titre de l’image depuis laquelle démarrer l’énumération. Ne peut être utilisé qu’avec $1sort=name.\";'),('fr','messages:apihelp-query+allimages-param-limit','s:37:\"Combien d’images renvoyer au total.\";'),('fr','messages:apihelp-query+allimages-param-maxsize','s:57:\"Restreindre aux images avec au plus ce nombre d’octets.\";'),('fr','messages:apihelp-query+allimages-param-mime','s:59:\"Quels types MIME rechercher, par ex. <kbd>image/jpeg</kbd>.\";'),('fr','messages:apihelp-query+allimages-param-minsize','s:58:\"Restreindre aux images avec au moins ce nombre d’octets.\";'),('fr','messages:apihelp-query+allimages-param-prefix','s:109:\"Rechercher toutes les images dont le titre commence par cette valeur. Utilisable uniquement avec $1sort=name.\";'),('fr','messages:apihelp-query+allimages-param-sha1','s:48:\"Hachage SHA1 de l’image. Écrase $1sha1base36.\";'),('fr','messages:apihelp-query+allimages-param-sha1base36','s:63:\"Hachage SHA1 de l’image en base 36 (utilisé dans MediaWiki).\";'),('fr','messages:apihelp-query+allimages-param-sort','s:31:\"Propriété par laquelle trier.\";'),('fr','messages:apihelp-query+allimages-param-start','s:91:\"L’horodatage depuis lequel énumérer. Ne peut être utilisé qu’avec $1sort=timestamp.\";'),('fr','messages:apihelp-query+allimages-param-to','s:102:\"Le titre de l’image auquel arrêter l’énumération. Ne peut être utilisé qu’avec $1sort=name.\";'),('fr','messages:apihelp-query+allimages-param-user','s:153:\"Renvoyer seulement les fichiers téléversés par cet utilisateur. Utilisabl