curitysensitiveoperation','s:77:\"Tester si l’authentification est suffisante pour l’action <kbd>foo</kbd>.\";'),('fr','messages:apihelp-query+authmanagerinfo-param-requestsfor','s:130:\"Récupérer les informations sur les requêtes d’authentification nécessaires pour l’action d’authentification spécifiée.\";'),('fr','messages:apihelp-query+authmanagerinfo-param-securitysensitiveoperation','s:155:\"Tester si l’état d’authentification actuel de l’utilisateur est suffisant pour l’opération spécifiée comme sensible du point de vue sécurité.\";'),('fr','messages:apihelp-query+authmanagerinfo-summary','s:78:\"Récupérer les informations concernant l’état d’authentification actuel.\";'),('fr','messages:apihelp-query+backlinks-example-generator','s:79:\"Obtenir des informations sur les pages ayant un lien vers <kbd>Main page</kbd>.\";'),('fr','messages:apihelp-query+backlinks-example-simple','s:45:\"Afficher les liens vers <kbd>Main page</kbd>.\";'),('fr','messages:apihelp-query+backlinks-param-dir','s:34:\"La direction dans laquelle lister.\";'),('fr','messages:apihelp-query+backlinks-param-filterredir','s:160:\"Comment filtrer les redirections. Si positionné à <kbd>nonredirects</kbd> quand <var>$1redirect</var> est activé, cela ne s’applique qu’au second niveau.\";'),('fr','messages:apihelp-query+backlinks-param-limit','s:215:\"Combien de pages renvoyer au total. Si <var>$1redirect</var> est activé, la limite s’applique à chaque niveau séparément (ce qui signifie jusqu’à 2 * <var>$1limit</var> résultats pouvant être retournés).\";'),('fr','messages:apihelp-query+backlinks-param-namespace','s:33:\"L’espace de noms à énumérer.\";'),('fr','messages:apihelp-query+backlinks-param-pageid','s:74:\"ID de la page à chercher. Impossible à utiliser avec <var>$1title</var>.\";'),('fr','messages:apihelp-query+backlinks-param-redirect','s:163:\"Si le lien vers une page est une redirection, trouver également toutes les pages qui ont un lien vers cette redirection. La limite maximale est d