ximal de pages à renvoyer.\";'),('fr','messages:apihelp-query+categorymembers-param-namespace','s:201:\"Inclure uniquement les pages dans ces espaces de nom. Remarquez que <kbd>$1type=subcat</kbd> ou <kbd>$1type=file</kbd> peuvent  être utilisés à la place de <kbd>$1namespace=14</kbd> ou <kbd>6</kbd>.\";'),('fr','messages:apihelp-query+categorymembers-param-pageid','s:93:\"ID de la page de la catégorie à énumérer. Impossible à utiliser avec <var>$1title</var>.\";'),('fr','messages:apihelp-query+categorymembers-param-prop','s:30:\"Quelles informations inclure :\";'),('fr','messages:apihelp-query+categorymembers-param-sort','s:31:\"Propriété par laquelle trier.\";'),('fr','messages:apihelp-query+categorymembers-param-start','s:102:\"Horodatage auquel démarrer la liste. Peut être utilisé uniquement avec <kbd>$1sort=timestamp</kbd>.\";'),('fr','messages:apihelp-query+categorymembers-param-starthexsortkey','s:150:\"Clé de tri à laquelle démarrer le listage, telle que renvoyée par <kbd>$1prop=sortkey</kbd>. Utilisable uniquement avec <kbd>$1sort=sortkey</kbd>.\";'),('fr','messages:apihelp-query+categorymembers-param-startsortkey','s:35:\"Utiliser plutôt $1starthexsortkey.\";'),('fr','messages:apihelp-query+categorymembers-param-startsortkeyprefix','s:152:\"Préfixe de la clé de tri à laquelle démarrer le listage. Utilisable uniquement avec <kbd>$1sort=sortkey</kbd>. Écrase <var>$1starthexsortkey</var>.\";'),('fr','messages:apihelp-query+categorymembers-param-title','s:149:\"Quelle catégorie énumérer (obligatoire). Doit comprendre le préfixe <kbd>{{ns:category}}:</kbd>. Impossible à utiliser avec <var>$1pageid</var>.\";'),('fr','messages:apihelp-query+categorymembers-param-type','s:105:\"Quel type de membres de la catégorie inclure. Ignoré quand <kbd>$1sort=timestamp</kbd> est positionné.\";'),('fr','messages:apihelp-query+categorymembers-paramvalue-prop-ids','s:25:\"Ajoute l’ID de la page.\";'),('fr','messages:apihelp-query+categorymembers-paramvalue-prop-sortkey','s:86:\"