eletedrevs-example-mode2','s:78:\"Lister les 50 dernières contributions de <kbd>Bob</kbd> supprimées (mode 2).\";'),('fr','messages:apihelp-query+deletedrevs-example-mode3-main','s:90:\"Lister les 50 premières révisions supprimées dans l’espace de noms principal (mode 3)\";'),('fr','messages:apihelp-query+deletedrevs-example-mode3-talk','s:88:\"Lister les 50 premières pages supprimées dans l’espace de noms {{ns:talk}} (mode 3).\";'),('fr','messages:apihelp-query+deletedrevs-extended-description','s:485:\"Opère selon trois modes :\n# Lister les révisions supprimées pour les titres donnés, triées par horodatage.\n# Lister les contributions supprimées pour l’utilisateur donné, triées par horodatage (pas de titres spécifiés).\n# Lister toutes les révisions supprimées dans l’espace de noms donné, triées par titre et horodatage (aucun titre spécifié, $1user non positionné).\n\nCertains paramètres ne s’appliquent qu’à certains modes et sont ignorés dans les autres.\";'),('fr','messages:apihelp-query+deletedrevs-param-end','s:49:\"L’horodatage auquel arrêter l’énumération.\";'),('fr','messages:apihelp-query+deletedrevs-param-excludeuser','s:49:\"Ne pas lister les révisions par cet utilisateur.\";'),('fr','messages:apihelp-query+deletedrevs-param-from','s:31:\"Démarrer la liste à ce titre.\";'),('fr','messages:apihelp-query+deletedrevs-param-limit','s:42:\"Le nombre maximal de révisions à lister.\";'),('fr','messages:apihelp-query+deletedrevs-param-namespace','s:52:\"Lister uniquement les pages dans cet espace de noms.\";'),('fr','messages:apihelp-query+deletedrevs-param-prefix','s:64:\"Rechercher tous les titres de page commençant par cette valeur.\";'),('fr','messages:apihelp-query+deletedrevs-param-prop','s:711:\"Quelles propriétés obtenir :\n;revid : Ajoute l’ID de la révision supprimée.\n;parentid : Ajoute l’ID de la révision précédente de la page.\n;user : Ajoute l’utilisateur ayant fait la révision.\n;userid : Ajoute l’ID de l’utilisateur qui a fait la révision.\n;comment : Ajoute le commentaire de la révision.\n;parsedcomment : Ajoute le commentaire analysé de la révision.\n;minor : Marque si la révision est mineure.\n;len : Ajoute la longueur (en octets) de la révision.\n;sha1 : Ajoute le SHA-1 (base 16) de la révision.\n;content : Ajoute le contenu de la révision.\n;token : <span class=\"apihelp-deprecated\">Désuet.</span> Fournit le jeton de modification.\n;tags : Balises pour la révision.\";'),('fr','messages:apihelp-query+deletedrevs-param-start','s:50:\"L’horodatage auquel démarrer l’énumération.\";'),('fr','messages:apihelp-query+deletedrevs-param-tag','s:60:\"Lister uniquement les révisions marquées par cette balise.\";'),('fr','messages:apihelp-query+deletedrevs-param-to','s:30:\"Arrêter la liste à ce titre.\";'),('fr','messages:apihelp-query+deletedrevs-param-unique','s:49:\"Lister uniquement une révision pour chaque page.\";'),('fr','messages:apihelp-query+deletedrevs-param-user','s:53:\"Lister uniquement les révisions par cet utilisateur.\";'),('fr','messages:apihelp-query+deletedrevs-paraminfo-modes','s:29:\"{{PLURAL:$1|Mode|Modes}} : $2\";'),('fr','messages:apihelp-query+deletedrevs-summary','s:34:\"Afficher les versions supprimées.\";'),('fr','messages:apihelp-query+disabled-summary','s:42:\"Ce module de requête a été désactivé.\";'),('fr','messages:apihelp-query+duplicatefiles-example-generated','s:44:\"Rechercher les doublons de tous les fichiers\";'),('fr','messages:apihelp-query+duplicatefiles-example-simple','s:62:\"Rechercher les doublons de [[:File:Albert Einstein Head.jpg]].\";'),('fr','messages:apihelp-query+duplicatefiles-param-dir','s:34:\"La direction dans laquelle lister.\";'),('fr','messages:apihelp-query+duplicatefiles-param-limit','s:43:\"Combien de fichiers dupliqués à renvoyer.\";'),('fr','messages:apihelp-query+duplicatefiles-param-localonly','s:63:\"Rechercher les fichiers uniquement dans le référentiel local.\";'),('fr','messages:apihelp-query+duplicatefiles-summary','s:104:\"Lister d’après l