:\"Quelles métadonnées obtenir.\";'),('fr','messages:apihelp-query-param-prop','s:55:\"Quelles propriétés obtenir pour les pages demandées.\";'),('fr','messages:apihelp-query-param-rawcontinue','s:72:\"Renvoyer les données <samp>query-continue</samp> brutes pour continuer.\";'),('fr','messages:apihelp-query-summary','s:42:\"Extraire des données de et sur MediaWiki.\";'),('fr','messages:apihelp-rawfm-summary','s:107:\"Extraire les données, y compris les éléments de débogage, au format JSON (affiché proprement en HTML).\";'),('fr','messages:apihelp-removeauthenticationdata-example-simple','s:98:\"Tentative de suppression des données de l’utilisateur pour <kbd>FooAuthenticationRequest</kbd>.\";'),('fr','messages:apihelp-removeauthenticationdata-summary','s:72:\"Supprimer les données d’authentification pour l’utilisateur actuel.\";'),('fr','messages:apihelp-resetpassword-example-email','s:132:\"Envoyer un courriel pour la réinitialisation de mot de passe à tous les utilisateurs avec l’adresse <kbd>user@example.com</kbd>.\";'),('fr','messages:apihelp-resetpassword-example-user','s:95:\"Envoyer un courriel de réinitialisation du mot de passe à l’utilisateur <kbd>Exemple</kbd>.\";'),('fr','messages:apihelp-resetpassword-extended-description-noroutes','s:209:\"Aucun chemin pour réinitialiser le mot de passe n’est disponible.\n\nActiver les chemins dans <var>[[mw:Special:MyLanguage/Manual:$wgPasswordResetRoutes|$wgPasswordResetRoutes]]</var> pour utiliser ce module.\";'),('fr','messages:apihelp-resetpassword-param-email','s:63:\"Adresse courriel de l’utilisateur ayant été réinitialisé.\";'),('fr','messages:apihelp-resetpassword-param-user','s:39:\"Utilisateur ayant été réinitialisé.\";'),('fr','messages:apihelp-resetpassword-summary','s:75:\"Envoyer un courriel de réinitialisation du mot de passe à un utilisateur.\";'),('fr','messages:apihelp-revisiondelete-example-log','s:140:\"Masquer toutes les données de l’entrée de journal <kbd>67890</kbd> avec le motif <kbd>Violation d