r','messages:apihelp-unblock-param-id','s:129:\"ID du blocage à lever (obtenu via <kbd>list=blocks</kbd>). Impossible à utiliser avec <var>$1user</var> ou <var>$1userid</var>.\";'),('fr','messages:apihelp-unblock-param-reason','s:20:\"Motif de déblocage.\";'),('fr','messages:apihelp-unblock-param-tags','s:76:\"Modifier les balises à appliquer à l’entrée dans le journal de blocage.\";'),('fr','messages:apihelp-unblock-param-user','s:153:\"Nom d’utilisateur, adresse IP ou plage d’adresses IP à débloquer. Impossible à utiliser en même temps que <var>$1id</var> ou <var>$1userid</var>.\";'),('fr','messages:apihelp-unblock-param-userid','s:100:\"ID de l\'utilisateur à débloquer. Ne peut être utilisé avec <var>$1id</var> ou <var>$1user</var>.\";'),('fr','messages:apihelp-unblock-summary','s:26:\"Débloquer un utilisateur.\";'),('fr','messages:apihelp-undelete-example-page','s:55:\"Annuler la suppression de la page <kbd>Main Page</kbd>.\";'),('fr','messages:apihelp-undelete-example-revisions','s:74:\"Annuler la suppression de deux révisions de la page <kbd>Main Page</kbd>.\";'),('fr','messages:apihelp-undelete-extended-description','s:279:\"Une liste des révisions supprimées (avec les horodatages) peut être récupérée via [[Special:ApiHelp/query+deletedrevisions|prop=deletedrevisions]], et une liste d’IDs de fichier supprimé peut être récupérée via [[Special:ApiHelp/query+filearchive|list=filearchive]].\";'),('fr','messages:apihelp-undelete-param-fileids','s:133:\"IDs des révisions de fichier à restaurer. Si <var>$1timestamps</var> et <var>$1fileids</var> sont vides, toutes seront restaurées.\";'),('fr','messages:apihelp-undelete-param-reason','s:22:\"Motif de restauration.\";'),('fr','messages:apihelp-undelete-param-tags','s:80:\"Modifier les balises à appliquer à l’entrée dans le journal de suppression.\";'),('fr','messages:apihelp-undelete-param-timestamps','s:130:\"Horodatages des révisions à restaurer. Si <var>$1timestamps</var> et <var>$1fileids</var> sont vides, toutes seront restaurées.\";'),('fr','messages:apihelp-undelete-param-title','s:30:\"Titre de la page à restaurer.\";'),('fr','messages:apihelp-undelete-param-watchlist','s:147:\"Ajouter ou supprimer la page de la liste de suivi de l’utilisateur actuel sans condition, utiliser les préférences ou ne pas modifier le suivi.\";'),('fr','messages:apihelp-undelete-summary','s:45:\"Restituer les versions d\'une page supprimée.\";'),('fr','messages:apihelp-unlinkaccount-example-simple','s:125:\"Essayer de supprimer le lien de l’utilisateur actuel pour le fournisseur associé avec <kbd>FooAuthenticationRequest</kbd>.\";'),('fr','messages:apihelp-unlinkaccount-summary','s:57:\"Supprimer un compte tiers lié de l’utilisateur actuel.\";'),('fr','messages:apihelp-upload-example-filekey','s:70:\"Terminer un téléversement qui a échoué à cause d’avertissements\";'),('fr','messages:apihelp-upload-example-url','s:27:\"Téléverser depuis une URL\";'),('fr','messages:apihelp-upload-extended-description','s:695:\"Plusieurs méthodes sont disponibles :\n* Téléverser directement le contenu du fichier, en utilisant le paramètre <var>$1file</var>.\n* Téléverser le fichier par morceaux, en utilisant les paramètres <var>$1filesize</var>, <var>$1chunk</var>, and <var>$1offset</var>.\n* Pour que le serveur MédiaWiki cherche un fichier depuis une URL, utilisez le paramètre <var>$1url</var>.\n* Terminer un téléversement précédent qui a échoué à cause d’avertissements, en utilisant le paramètre <var>$1filekey</var>.\nNoter que le POST HTTP doit être fait comme un téléversement de fichier (par ex. en utilisant <code>multipart/form-data</code>) en envoyant le <code>multipart/form-data</code>.\";'),('fr','messages:apihelp-upload-param-async','s:86:\"Faire les grosses opérations de fichiers de façon asynchrone quand c’est possible.\";'),('fr','messages:apihelp-upload-param-checkstatus','s:84:\"Récupérer uniquement l’état de téléversement pour la clé de fichier donnée.\";'),('fr','messages:apihelp-upload-param-chunk','s:18:\"Partie du contenu.\";'),('fr','messages:apihelp-upload-param-comment','s:147:\"Téléverser le commentaire. Utilisé aussi comme texte de la page initiale pour les nouveaux fichiers si <var>$1text</var> n’est pas spécifié.\";'),('fr','messages:apihelp-upload-param-file','s:19:\"Contenu du fichier.\";'),('fr','messages:apihelp-upload-param-filekey','s:78:\"Clé identifiant un téléversement précédent temporairement mis en attente.\";'),('fr','messages:apihelp-upload-param-filename','s:21:\"Nom de fichier cible.\";'),('fr','messages:apihelp-upload-param-filesize','s:33:\"Taille du téléversement entier.\";'),('fr','messages:apihelp-upload-param-ignorewarnings','s:32:\"Ignorer tous les avertissements.\";'),('fr','messages:apihelp-upload-param-offset','s:28:\"Décalage du bloc en octets.\";'),('fr','messages:apihelp-upload-param-sessionkey','s:74:\"Comme $1filekey, conservé pour des raisons de compatibilité descendante.\";'),('fr','messages:apihelp-upload-param-stash','s:98:\"Si positionné, le serveur conservera temporairement le fichier au lieu de l’ajouter au dépôt.\";'),('fr','messages:apihelp-upload-param-tags','s:120:\"Modifier les balises à appliquer à l’entrée du journal de téléversement et à la révision de la page du fichier.\";'),('fr','messages:apihelp-upload-param-text','s:50:\"Texte de page initiale pour les nouveaux fichiers.\";'),('fr','messages:apihelp-upload-param-url','s:28:\"URL où chercher le fichier.\";'),('fr','messages:apihelp-upload-param-watch','s:15:\"Suivre la page.\";'),('fr','messages:apihelp-upload-param-watchlist','s:146:\"Ajouter ou supprimer sans condition la page de la liste de suivi de l’utilisateur actuel, utiliser les préférences ou ne pas changer le suivi.\";'),('fr','messages:apihelp-upload-summary','s:76:\"Téléverser un fichier, ou obtenir l’état des téléversements en cours.\";'),('fr','messages:apihelp-userrights-example-expiry','s:86:\"Ajouter l\'utilisateur <kbd>SometimeSysop</kbd> au groupe <kbd>sysop</kbd> pour 1 mois.\