Example</kbd>.\";'),('fr','messages:apihelp-validatepassword-extended-description','s:208:\"La validation est <samp>Good</samp> si le mot de passe est acceptable, <samp>Change</samp> s\'il peut être utilisé pour se connecter et doit être changé, ou  <samp>Invalid</samp> s\'il n\'est pas utilisable.\";'),('fr','messages:apihelp-validatepassword-param-email','s:53:\"Adresse courriel, pour tester la création de compte.\";'),('fr','messages:apihelp-validatepassword-param-password','s:24:\"Mot de passe à valider.\";'),('fr','messages:apihelp-validatepassword-param-realname','s:45:\"Vrai nom, pour tester la création de compte.\";'),('fr','messages:apihelp-validatepassword-param-user','s:98:\"Nom de l\'utilisateur, pour tester la création de compte. L\'utilisateur ne doit pas déja exister.\";'),('fr','messages:apihelp-validatepassword-summary','s:87:\"Valider un mot de passe conformément aux règles concernant les mots de passe du wiki.\";'),('fr','messages:apihelp-watch-example-generator','s:67:\"Suivre les quelques premières pages de l’espace de nom principal\";'),('fr','messages:apihelp-watch-example-unwatch','s:50:\"Ne plus suivre la page <kbd>Page principale</kbd>.\";'),('fr','messages:apihelp-watch-example-watch','s:36:\"Suivre la page <kbd>Main Page</kbd>.\";'),('fr','messages:apihelp-watch-param-title','s:66:\"La page à (ne plus) suivre. Utiliser plutôt <var>$1titles</var>.\";'),('fr','messages:apihelp-watch-param-unwatch','s:59:\"Si défini, la page ne sera plus suivie plutôt que suivie.\";'),('fr','messages:apihelp-watch-summary','s:78:\"Ajouter ou supprimer des pages de la liste de suivi de l’utilisateur actuel.\";'),('fr','messages:apihelp-xml-param-includexmlnamespace','s:44:\"Si spécifié, ajoute un espace de noms XML.\";'),('fr','messages:apihelp-xml-param-xslt','s:176:\"Si spécifié, ajoute la page nommée comme une feuille de style XSL. La valeur doit être un titre dans l’espace de noms {{ns:MediaWiki}} se terminant par <code>.xsl</code>.\";'),('fr','messages:a