lisée pour évincer la sécurité concernant le contrôle de la même source dans le navigateur. Notez que la gestion automatique du jeton de l\'API du bac à sable ne fonctionne pas correctement avec de telles requêtes; vous devez les remplir manuellement.\";'),('fr','messages:apisandbox-retry','s:10:\"Réessayer\";'),('fr','messages:apisandbox-sending-request','s:32:\"Envoi de la requête à l\'API...\";'),('fr','messages:apisandbox-submit','s:19:\"Envoyer la requête\";'),('fr','messages:apisandbox-submit-invalid-fields-message','s:60:\"Veuillez corriger les champs marqués et essayez de nouveau.\";'),('fr','messages:apisandbox-submit-invalid-fields-title','s:35:\"Certains champs ne sont pas valides\";'),('fr','messages:apisandbox-summary','s:0:\"\";'),('fr','messages:apisandbox-templated-parameter-reason','s:135:\"Ce [[Special:ApiHelp/main#main/templatedparams|paramètre de modèle]] est offert d’après {{PLURAL:$1|la valeur|les valeurs}} de $2.\";'),('fr','messages:apiwarn-alldeletedrevisions-performance','s:98:\"Pour de meilleures performances lors de la génération des titres, mettre <kbd>$1dir=newer</kbd>.\";'),('fr','messages:apiwarn-badurlparam','s:101:\"Impossible d\'analyser <var>$1urlparam</var> pour $2. En utilisant seulement la largeur et la hauteur.\";'),('fr','messages:apiwarn-badutf8','s:242:\"La valeur passée pour <var>$1</var> contient des données non valides ou non normalisées. Les données textuelles doivent être de l’Unicode valide normalisé en NFC sans caractères de contrôle c0 autres que HT (\\t), LF (\\n) et CR (\\r).\";'),('fr','messages:apiwarn-checktoken-percentencoding','s:110:\"Vérifier que les symboles tels que \"+\" dans le jeton sont correctement  codés avec des pourcents dans l\'URL.\";'),('fr','messages:apiwarn-compare-no-next','s:108:\"Revision $2 is the latest revision of $1, there is no revision for <kbd>torelative=next</kbd> to compare to.\";'),('fr','messages:apiwarn-compare-no-prev','s:110:\"Revision $2 is the earliest revision of $1, there is no revision for <kbd>torelative=prev</kbd> to compare to.\";'),('fr','messages:apiwarn-compare-nocontentmodel','s:69:\"Aucun modèle de contenu n’a pu être déterminé, $1 est supposé.\";'),('fr','messages:apiwarn-deprecation-deletedrevs','s:150:\"<kbd>list=deletedrevs</kbd> est devenu désuet. Veuillez utiliser <kbd>prop=deletedrevisions</kbd> ou <kbd>list=alldeletedrevisions</kbd> à la place.\";'),('fr','messages:apiwarn-deprecation-httpsexpected','s:46:\"HTTP est utilisé alors que HTTPS est attendu.\";'),('fr','messages:apiwarn-deprecation-login-botpw','s:337:\"La connexion au compte principal via <kbd>action=login</kbd> est désuète et peut cesser de fonctionner sans avertissement. Pour continuer à vous connecter avec <kbd>action=login</kbd>, voyez [[Special:BotPasswords]]. Pour continuer à utiliser la connexion au compte principal en toute sécurité, voyez <kbd>action=clientlogin</kbd>.\";'),('fr','messages:apiwarn-deprecation-login-nobotpw','s:202:\"La connexion au compte principal via <kbd>action=login</kbd> est désuète et peut cesser de fonctionner sans avertissement. Pour vous connecter en toute sécurité, voyez <kbd>action=clientlogin</kbd>.\";'),('fr','messages:apiwarn-deprecation-login-token','s:142:\"La récupération d’un jeton via <kbd>action=login</kbd> est désuète. Utilisez <kbd>action=query&meta=tokens&type=login</kbd> à la place.\";'),('fr','messages:apiwarn-deprecation-missingparam','s:182:\"Comme <var>$1</var> n’a pas été spécifié, un format ancien a été utilisé pour la sortie. Ce format est obsolète, et dans le futur, le nouveau format sera toujours utilisé.\";'),('fr','messages:apiwarn-deprecation-parameter','s:40:\"Le paramètre <var>$1</var> est désuet.\";'),('fr','messages:apiwarn-deprecation-parse-headitems','s:239:\"<kbd>prop=headitems</kbd> est désuet depuis MédiaWiki 1.28. Utilisez <kbd>prop=headhtml</kbd> lors de la création de nouveaux documents HTML, ou <kbd>prop=modules|jsconfigvars</kbd> lors de la mise à jour d’un document côté client.\