s. Vouliez-vous utiliser <var>oldid</var> au lieu de <var>revid</var> ?\";'),('fr','messages:apiwarn-parse-titlewithouttext','s:199:\"<var>title</var> utilisé sans <var>text</var>, et les propriétés de page analysées sont nécessaires. Voulez-vous dire que vous voulez utiliser <var>page</var> à la place de <var>title</var> ?\";'),('fr','messages:apiwarn-redirectsandrevids','s:194:\"La résolution de la redirection ne peut pas être utilisée avec le paramètre <var>revids</var>. Toutes les redirections vers lesquelles pointent <var>revids</var> n’ont pas été résolues.\";'),('fr','messages:apiwarn-tokennotallowed','s:69:\"L\'action « $1 » n\'est pas autorisée pour l\'utilisateur actuel.\";'),('fr','messages:apiwarn-tokens-origin','s:99:\"Les jetons ne peuvent pas être obtenus quand la politique de même origine n’est pas appliquée.\";'),('fr','messages:apiwarn-truncatedresult','s:86:\"Ce résultat a été tronqué parce que sinon, il dépasserait la limite de $1 octets.\";'),('fr','messages:apiwarn-unclearnowtimestamp','s:246:\"Passer « $2 » comme paramètre d’horodatage <var>$1</var> a été rendu désuet. Si, pour une raison quelconque, vous avez besoin de spécifier explicitement l’heure courante sans la recalculer du côté client, utilisez <kbd>now</kbd>.\";'),('fr','messages:apiwarn-unrecognizedvalues','s:94:\"{{PLURAL:$3|Valeur non reconnue|Valeurs non reconnues}} pour le paramètre <var>$1</var> : $2.\";'),('fr','messages:apiwarn-unsupportedarray','s:83:\"Le paramètre <var>$1</var> utilise une syntaxe PHP de tableau non prise en charge.\";'),('fr','messages:apiwarn-urlparamwidth','s:168:\"Valeur de la largeur définie dans <var>$1urlparam</var> ($2) ignorée en faveur de la largeur calculée à partir de <var>$1urlwidth</var>/<var>$1urlheight</var> ($3).\";'),('fr','messages:apiwarn-validationfailed','s:43:\"Erreur de validation pour <kbd>$1</kbd>: $2\";'),('fr','messages:apiwarn-validationfailed-badchars','s:151:\"caractères non valides dans la clé (<code>a-z</code>, <code>A-Z</co