te « $2 » de {{SITENAME}}\nen cette adresse.\n\nPour confirmer que ce compte vous appartient vraiment et afin\nde réactiver les fonctions de messagerie sur {{SITENAME}},\nveuillez suivre ce lien dans votre navigateur :\n\n$3\n\nSi ce compte ne vous appartient *pas*, n’ouvrez pas ce lien ;\nvous pouvez suivre l’autre lien ci-dessous pour annuler la\nconfirmation de votre adresse courriel :\n\n$5\n\nCe code de confirmation expirera le $4.\";'),('fr','messages:confirmemail_body_set','s:462:\"Quelqu’un, probablement vous, depuis l’adresse IP $1, a modifié l’adresse de courriel du compte « $2 » en celle-ci sur {{SITENAME}}.\n\nPour confirmer que ce compte vous appartient et réactiver les fonctions de courriel sur {{SITENAME}}, ouvrez ce lien dans votre navigateur Web :\n\n$3\n\nSi le compte ne vous appartient *pas*, suivez plutôt ce lien pour annuler la confirmation de l’adresse de courriel :\n\n$5\n\nCe code de confirmation expirera le $4.\";'),('fr','messages:confirmemail_invalid','s:62:\"Code de confirmation incorrect.\nCelui-ci a peut-être expiré.\";'),('fr','messages:confirmemail_invalidated','s:45:\"Confirmation de l’adresse courriel annulée\";'),('fr','messages:confirmemail_loggedin','s:52:\"Votre adresse de courriel est maintenant confirmée.\";'),('fr','messages:confirmemail_needlogin','s:60:\"Vous devez vous $1 pour confirmer votre adresse de courriel.\";'),('fr','messages:confirmemail_noemail','s:116:\"Vous n’avez pas défini une adresse de courriel valide dans vos [[Special:Preferences|préférences utilisateur]].\";'),('fr','messages:confirmemail_oncreate','s:201:\"Un code de confirmation a été envoyé à votre adresse de courriel.\nCe code n’est pas requis pour vous identifier sur ce wiki, mais vous devrez le fournir pour activer toute fonction de messagerie.\";'),('fr','messages:confirmemail_pending','s:197:\"Un code de confirmation vous a déjà été envoyé par courriel ;\nsi vous venez de créer votre compte, veuillez attendre quelques minutes que le courriel arrive avant de demander un nouveau code.\";'),('fr','messages:confirmemail_send','s:31:\"Envoyer un code de confirmation\";'),('fr','messages:confirmemail_sendfailed','s:233:\"{{SITENAME}} n’a pas pu vous envoyer le courriel de confirmation.\nVeuillez vérifiez que votre adresse de courriel ne comprend aucun caractère incorrect.\n\nLe programme d’envoi de courriel a retourné l’indication suivante : $1\";'),('fr','messages:confirmemail_sent','s:32:\"Courriel de confirmation envoyé\";'),('fr','messages:confirmemail_subject','s:54:\"Confirmation d’adresse de courriel pour {{SITENAME}}\";'),('fr','messages:confirmemail_success','s:146:\"Votre adresse de courriel a été confirmée.\nVous pouvez maintenant vous [[Special:UserLogin|{{MediaWiki:Loginreqlink/fr}}]] et profiter du wiki.\";'),('fr','messages:confirmemail_text','s:394:\"Ce wiki nécessite la vérification de votre adresse de courriel avant de pouvoir utiliser toute fonction de messagerie.\nUtilisez le bouton ci-dessous pour envoyer un courriel de confirmation à votre adresse.\nLe courriel inclura un lien comportant un code à usage unique et limité dans le temps ;\nchargez ce lien dans votre navigateur pour confirmer que votre adresse de courriel est valide.\";'),('fr','messages:confirmrecreate','s:258:\"L’utilisat{{GENDER:$1|eur|rice}} [[User:$1|$1]] ([[User talk:$1|Discussion]]) a supprimé cette page, alors que vous aviez commencé à la modifier, pour le motif suivant :\n: <em>$2</em>\nVeuillez confirmer que vous désirez réellement recréer cette page.\";'),('fr','messages:confirmrecreate-noreason','s:220:\"L’utilisat{{GENDER:$1|eur|rice}} [[User:$1|$1]] ([[User talk:$1|Discussion]]) a supprimé cette page, alors que vous aviez commencé à la modifier. Veuillez confirmer que vous désirez réellement recréer cette page.\";'),('fr','messages:content-failed-to-parse','s:73:\"Échec de l’analyse syntaxique du contenu de $2 pour le modèle $1 : $3\";'),('fr','messages:content-json-empty-array','s:12:\"Tableau vide\";'),('fr','mes