\";'),('fr','messages:expand_templates_preview_fail_html_anon','s:284:\"<em>Comme {{SITENAME}} a activé le HTML brut et que vous n’êtes pas connecté, l’aperçu est masqué par précaution contre les attaques JavaScript.</em>\n\n<strong>Si c’est une demande d’aperçu légitime, veuillez [[Special:UserLogin|vous connecter]] et réessayer.</strong>\";'),('fr','messages:expand_templates_remove_comments','s:26:\"Supprimer les commentaires\";'),('fr','messages:expand_templates_remove_nowiki','s:49:\"Supprime les marqueurs <nowiki> dans le résultat\";'),('fr','messages:expand_templates_title','s:61:\"Titre de la page, si le code utilise {{FULLPAGENAME}}, etc. :\";'),('fr','messages:expand_templates_xml_output','s:54:\"Résultat intermédiaire de l’analyse, au format XML\";'),('fr','messages:expandtemplates','s:22:\"Expansion des modèles\";'),('fr','messages:expansion-depth-exceeded-category','s:51:\"Pages dépassant la profondeur d\'expansion maximale\";'),('fr','messages:expansion-depth-exceeded-category-desc','s:54:\"La page dépasse la profondeur d’expansion maximale.\";'),('fr','messages:expansion-depth-exceeded-warning','s:52:\"Page dépassant la profondeur d’expansion maximale\";'),('fr','messages:expensive-parserfunction-category','s:76:\"Pages avec trop d\'appels dispendieux aux fonctions de l\'analyseur syntaxique\";'),('fr','messages:expensive-parserfunction-category-desc','s:229:\"La page utilise trop de fonctions coûteuses de l’analyseur (comme <code>#ifexist</code>). Voyez [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:$wgExpensiveParserFunctionLimit Manual:$wgExpensiveParserFunctionLimit].\";'),('fr','messages:expensive-parserfunction-warning','s:220:\"<strong>Attention :</strong> cette page contient de trop nombreux appels à des fonctions coûteuses de l’analyseur syntaxique.\n\nIl devrait y avoir moins de $2 appel{{PLURAL:$2||s}}, alors qu’il y en a maintenant $1.\";'),('fr','messages:expiringblock','s:18:\"expire le $1 à $2\";'),('fr','messages:explainconflict','s:439:\"Cette page a été changée après que vous avez commencé à la modifier.\nLa zone de modification supérieure contient le texte tel qu’il est actuellement enregistré dans la base de données.\nVos modifications apparaissent dans la zone de modification inférieure.\nVous allez devoir fusionner vos modifications dans le texte existant.\n<strong>Seul</strong> le texte de la zone supérieure sera sauvegardé si vous cliquez sur « $1 ».\";'),('fr','messages:export','s:18:\"Exporter des pages\";'),('fr','messages:export-addcat','s:7:\"Ajouter\";'),('fr','messages:export-addcattext','s:36:\"Ajouter les pages de la catégorie :\";'),('fr','messages:export-addns','s:7:\"Ajouter\";'),('fr','messages:export-addnstext','s:39:\"Ajouter des pages de l\'espace de noms :\";'),('fr','messages:export-download','s:27:\"Enregistrer dans un fichier\";'),('fr','messages:export-manual','s:32:\"Ajouter des pages manuellement :\";'),('fr','messages:export-pagelinks','s:53:\"Inclure les pages liées jusqu\'à une profondeur de :\";'),('fr','messages:export-submit','s:8:\"Exporter\";'),('fr','messages:export-summary','s:0:\"\";'),('fr','messages:export-templates','s:20:\"Inclure les modèles\";'),('fr','messages:exportall','s:25:\"Exporter toutes les pages\";'),('fr','messages:exportcuronly','s:68:\"Exporter uniquement la version courante, sans l’historique complet\";'),('fr','messages:exportlistauthors','s:62:\"Inclure une liste complète des contributeurs pour chaque page\";'),('fr','messages:exportnohistory','s:163:\"----\n<strong>Note :</strong> l’exportation de l’historique complet des pages à l’aide de ce formulaire a été désactivée pour des raisons de performance.\";'),('fr','messages:exporttext','s:720:\"Vous pouvez exporter en XML le texte et l’historique d’une page ou d’un ensemble de pages.\nLe résultat peut alors être importé dans un autre wiki utilisant le logiciel MediaWiki via la [[Special:Import|page d’importation]].\n\nPour exporter des pages, entrez leurs titres dans la boîte de texte ci-dessous, à raison d’un titre par ligne. Sélectionnez si vous désirez la version actuelle avec toutes les anciennes versions, avec les lignes de l’historique de la page, ou simplement la page actuelle avec des informations sur la dernière modification.\n\nDans ce dernier cas vous pouvez aussi utiliser un lien, tel que [[{{#Special:Export}}/{{MediaWiki:Mainpage}}]] pour la page [[{{MediaWiki:Mainpage}}]].\";'),('fr','messages:external_image_whitelist','s:568:\" #Laisser cette ligne exactement telle quelle.<pre>\n#Indiquer les fragments d\'expressions rationnelles (juste la partie indiquée entre les //) ci-dessous.\n#Ils correspondront avec les URL des images externes.\n#Celles qui correspondent s\'afficheront comme des images, sinon seul un lien vers l\'image sera affiché.\n#Les lignes commençant par un # seront considérées comme des commentaires.\n#Cette liste n\'est pas sensible à la casse.\n\n#Mettez tous les fragments d\'expressions rationnelles au-dessus de cette ligne. Laissez cette dernière ligne telle quelle.</pre>\";'),('fr','messages:externaldberror','s:152:\"Soit une erreur s’est produite sur la base de données d’authentification, soit vous n’êtes pas autorisé à mettre à jour votre compte externe.\";'),('fr','messages:extlink_sample','s:37:\"http://www.example.com/ titre du lien\";'),('fr','messages:extlink_tip','s:48:\"Lien externe (n\'oubliez pas le préfixe http://)\";'),('fr','messages:faq','s:3:\"FAQ\";'),('fr','messages:feb','s:5:\"fév.\";'),('fr','messages:february','s:8:\"février\";'),('fr','messages:february-date','s:34:\"{{PLURAL:$1|1=1ᵉʳ|$1}} février\";'),('fr','messages:february-gen','s:8:\"février\";'),('fr','messages:feed-atom','s:4:\"Atom\";'),('fr','messages:feed-invalid','s:39:\"Type de flux d’abonnement non valide.\";'),('fr','messages:feed-rss','s:3:\"RSS\";'),('fr','messages:feed-unavailable','s:47:\"Les flux de syndication ne sont pas disponibles\";'),('fr','messages:feedback-adding','s:39:\"Ajout de vos commentaires à la 