 expireront}} dans {{PLURAL:$5|un jour|$5 jours}}. \nVous devez maintenant vous connecter et choisir un nouveau mot de passe. Si cette demande ne provient pas de vous, ou si vous avez retrouvé votre mot de passe initial, et ne souhaitez plus le modifier, vous pouvez ignorer ce message et continuer à utiliser votre ancien mot de passe.\";'),('fr','messages:passwordreset-emailtext-user','s:745:\"L’{{GENDER:$1|utilisateur|utilisatrice}} $1 sur {{SITENAME}} a demandé une réinitialisation de votre mot de passe pour {{SITENAME}} ($4). {{PLURAL:$3|Le compte de l’{{GENDER:$2|utilisateur suivant|utilisatrice suivante}} est associé|Les comptes des utilisateurs suivants sont associés}} à cette adresse de courriel :\n\n$2\n\n{{PLURAL:$3|Ce mot de passe temporaire expirera|Ces mots de passe temporaires expireront}} dans {{PLURAL:$5|un jour|$5 jours}}. \nVous devez maintenant vous connecter et choisir un nouveau mot de passe. Si cette demande ne provient pas de vous, ou si vous avez retrouvé votre mot de passe initial, et ne souhaitez plus le modifier, vous pouvez ignorer ce message et continuer à utiliser votre ancien mot de passe.\";'),('fr','messages:passwordreset-emailtitle','s:35:\"Détails du compte sur {{SITENAME}}\";'),('fr','messages:passwordreset-ignored','s:122:\"La réinitialisation du mot de passe n’a pas été gérée. Peut-être qu’aucun fournisseur n’a été configuré ?\";'),('fr','messages:passwordreset-invalidemail','s:32:\"Adresse de messagerie non valide\";'),('fr','messages:passwordreset-nocaller','s:29:\"Un appelant doit être fourni\";'),('fr','messages:passwordreset-nodata','s:69:\"Aucun nom d’utilisateur ou adresse de messagerie n’a été fourni\";'),('fr','messages:passwordreset-nosuchcaller','s:32:\"L’appelant n’existe pas : $1\";'),('fr','messages:passwordreset-text-many','s:93:\"{{PLURAL:$1|Remplissez un des champs pour recevoir un mot de passe temporaire par courriel.}}\";'),('fr','messages:passwordreset-text-one','s:64:\"Remplissez ce formulaire pour réinitiali